INSERT INTO `ps_blog_post_data` VALUES
('5','1','Superbugs Becoming an Increasing Threat','Superbugs, hospitals, infection rate, cure, hands','Superbug infections are on the rise in hospitals across the United States, and the consequences can be deadly.   ','<p><span>Superbug infections are on the rise in hospitals across the United States, and the consequences can be deadly.   </span><br /><br /><span>Jeffrey Simcox learned that lesson after minor surgery at his local hospital. Within five days after surgery, he was diagnosed with a superbug that threatened his life and took nearly a year to fully cure.</span><br /><a href=\"http://www.necn.com/06/02/13/Superbugs-becoming-an-increasing-threat/landing.html?blockID=842691\">http://www.necn.com/06/02/13/Superbugs-becoming-an-increasing-threat/landing.html?blockID=842691</a></p>','postnaFXqc'),
('6','1','Plasma Therapy Healing Chronic, Non-healing Wounds','chronic wounds, non-healing wounds, platelet, plasma therapy, amputation','Dr. Bill J Releford, DPM, medical director and founder of the Releford Foot and Ankle Institute announced today results from several case studies using platelet rich plasma therapy to heal chronic nonhealing wounds. Each patient was recommended for high level amputation...\r\n\r\n','<p><span>Dr. Bill J Releford, DPM, medical director and founder of the Releford Foot and Ankle Institute announced today results from several case </span><a id=\"itxthook0\" class=\"itxtnewhook itxthook\" href=\"http://www.watchlistnews.com/2013/07/14/dr-bill-releford-finds-continued-success-with-platelet-rich-plasma-to-treat-chronic-non-healing-wounds/#\" rel=\"nofollow\"><span id=\"itxthook0p\" class=\"itxtrst itxtrstspan itxtnowrap\"><span id=\"itxthook0w\" class=\"itxtrst itxtrstspan itxtnowrap itxtnewhookspan\">studies</span><img id=\"itxthook0icon\" class=\"itxtrst itxtrstimg itxthookicon\" src=\"http://images.intellitxt.com/ast/adTypes/icon1.png\" alt=\"\" /></span></a><span> using platelet rich plasma therapy to heal chronic nonhealing wounds. Each patient was recommended for high level amputation...</span></p>\r\n<p><span><a href=\"http://www.watchlistnews.com/2013/07/14/dr-bill-releford-finds-continued-success-with-platelet-rich-plasma-to-treat-chronic-non-healing-wounds/\">http://www.watchlistnews.com/2013/07/14/dr-bill-releford-finds-continued-success-with-platelet-rich-plasma-to-treat-chronic-non-healing-wounds/</a></span></p>','post2OR8C2'),
('3','1','With Money at Risk, Hospitals Push Staff to Wash Hands','superbugs, infection, CDC, death. hands, hospitals','With drug-resistant superbugs on the rise, according to a recent report by the federal Centers for Disease Control and Prevention, and with hospital-acquired infections costing $30 billion and leading to nearly 100,000 patient deaths a year, hospitals are willing to try almost anything to reduce the risk of transmission.','<p><span>With </span><a href=\"http://www.nytimes.com/2013/03/06/health/deadly-drug-resistant-infections-rise-in-hospitals-report-warns.html\">drug-resistant superbugs on the rise</a><span>, according to a recent report by the federal </span><a href=\"http://www.cdc.gov/handhygiene/?s_cid=dhqp_009\">Centers for Disease Control and Prevention</a><span>, and with hospital-acquired infections costing $30 billion and leading to nearly 100,000 patient deaths a year, hospitals are willing to try almost anything to </span><a href=\"http://bit.ly/ZrDSRO\">reduce the risk</a> <span>of transmission.</span><br /><br /><a href=\"http://www.nytimes.com/2013/05/29/nyregion/hospitals-struggle-to-get-workers-to-wash-their-hands.html?pagewanted=all&amp;_r=0\">http://www.nytimes.com/2013/05/29/nyregion/hospitals-struggle-to-get-workers-to-wash-their-hands.html?pagewanted=all&amp;_r=0</a></p>','postG33tEV'),
('7','1','Chronic wounds affect around 6.5 million patients in the USA.','chronic, wounds, USA, wound care',NULL,'<p>http://www.wcjb.com/your-health-local-news-health/2013/12/medical-spotlight-advanced-wound-care</p>','postg4PB1v'),
('4','1','What is a Collagen dressing?',NULL,'These dressings come in pads, gels or particles and promote the formation or growth of small blood vessels and connective tissue (granulation) necessary for healing.  ','<p><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">These dressings come in pads, gels or particles and promote the formation or growth of small blood vessels and connective tissue (granulation) necessary for healing. </span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #6ab4e4;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Drainage requirement: </span></span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">minimal, moderate or heavy </span></span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #6ab4e4;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Indicated for: </span></span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">any kind of wound </span></span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">that is free of </span></span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">slough or necrotic tissue including burns </span></span></span></span><span style=\"font-size: medium; font-family: Arial, serif; color: #808080; line-height: 1.5em;\">and grafts.</span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #6ab4e4;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Action: </span></span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">provides a moist healing environment, may reduce excess MMP’s which can </span></span></span></span><span style=\"font-size: medium; font-family: Arial, serif; color: #808080; line-height: 1.5em;\">prevent healing, promotes tissue growth and healing</span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #6ab4e4;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Contraindications: </span></span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">should not be used if wound contains nonviable tissue</span></span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #6ab4e4;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Examples: </span></span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Biopad, Stimulen, Promogran, Prisma, Endoform</span></span></span></span></p>\r\n<p> </p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #ff9933;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\"><strong>Dressing changes:</strong></span></span></span><span style=\"color: #ff9933;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\"> Collagens will absorb into the wound over time and do not need to be rinsed out. Simply add more collagen every 2-3 days.</span></span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #ff9933;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\"><strong>Usage:</strong></span></span></span><span style=\"color: #ff9933;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\"> A secondary dressing is necessary to hold in place.</span></span></span></span></p>\r\n<p> </p>\r\n<p align=\"CENTER\"><span style=\"color: #000000;\"><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Collagen dressings can be found under the <a href=\"http://admedonline.com/6-wound-care\">Wound Care heading</a></span></span></span></span></p>\r\n<p align=\"CENTER\"><span style=\"color: #000000;\"><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">in the </span></span></span><a href=\"http://admedonline.com/36-collagen\"><span style=\"color: #6ab4e4;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\"><em><strong>Collagen</strong></em></span></span></span></a><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\"> category.</span></span></span></span></p>','postP8qgTH'),
('8','1','EB: Wounds for Life','EB, Epidermolysis Bullosa, wound care, pain, bandages, skin, blisters, tears, genetic, butterfly children, wounds, treatment, wound care','The Worst Disease You\'ve Never Heard Of.™\r\n\r\nEpidermolysis Bullosa, or EB, is a very rare genetic connective tissue disorder that affects 1 child out of every 20,000 births (that means about 200 children a year are born with EB).  EB is actually a group of disorders that share a prominent manifestation of extremely fragile skin that blisters and tears from friction or trauma. Internal organs and bodily systems can also be seriously affected by EB.  The list of secondary complications can be long and may require multiple interventions from a range of medical specialists.  As of today, there is no cure or treatment.  Daily wound care, pain management and protective bandaging are the only options available.....http://www.debra.org/whatiseb\r\n\r\n','<h2>What is EB?</h2>\r\n<p> </p>\r\n<div id=\"node-6\" class=\"node node-odd node-type-page full-node taxonomy-vocab\">\r\n<div class=\"content\">\r\n<p>The Worst Disease You\'ve Never Heard Of.™</p>\r\n<p><strong style=\"font-size: 12px; line-height: 1.5em;\">Epidermolysis Bullosa, or EB,</strong><span style=\"font-size: 12px; line-height: 1.5em;\"> is a very rare genetic connective tissue disorder that affects 1 child out of every 20,000 births (that means about 200 children a year are born with EB).  EB is actually a group of disorders that share a prominent manifestation of extremely fragile skin that blisters and tears from friction or trauma. Internal organs and bodily systems can also be seriously affected by EB.  The list of secondary complications  can be long and may require multiple interventions from a range of medical specialists.  As of today, there is no cure or treatment.  Daily wound care, pain management and protective bandaging are the only options available.</span></p>\r\n</div>\r\n</div>\r\n<p>The manifestations of EB, the symptoms the person suffers from, and the overall long term outcome on quality of life run the gamut from mild to devastatingly severe.  This is dependent on several factors including the type and subtype of EB and the inheritance pattern (autosomal dominant versus recessive).  There are many people who are diagnosed with milder forms of EB, which, while they can be extremely difficult and painful to live with, are not disfiguring or lethal.  In these forms of EB blistering of the skin may be limited to the hands and feet which may not result in any scarring or loss of function.  In more severe forms there is generalized blistering of the skin as well as injury to many internal organs and bodily systems.  These more severe forms of EB result in disfigurement, disability and early death, usually before the age of 30.  In fact, some forms of EB are lethal in the first few months of life. </p>\r\n<p>EB is caused by mutations in the DNA code that make up genes.  Genes are responsible for making and expressing proteins.  EB can result from one genetic mutation in any one of the 18 genes that have been found to cause the disorder.  These mutations, or errors in the genetic code, may not allow the affected gene to produce a specific protein, or it may result in the incorrect formation of that protein.  Either way, the mutation does not enable the affected protein to work correctly thus resulting in extremely fragile skin, and other manifestations of EB like: anemia, cardiomyopathy, syndactyly (fusion of the fingers and toes), renal insufficiency, dysphagia (difficulty swallowing), malnourishment, cancer, constipation, osteoporosis, muscular dystrophy and pyloric atresia.  </p>\r\n<p>There are four types of genetically inherited EB: Simplex, Dystrophic, Junctional and Kindler.  These four major types of EB differ phenotypically (what physical manifestations look like) and genotypically (the genetic makeup) as well as by the area of the skin where there is blistering, otherwise known as “the site of ultra-structural disruption or cleavage”.  There is also an autoimmune form of the disorder called, EB Acquisita .</p>\r\n<p>Children with EB are known as Butterfly children because their skin is as fragile as the wings of a butterfly.</p>\r\n<p>There are about 30,000 people with EB in the United States.</p>\r\n<p>EB affects both genders and every racial and ethnic background. </p>\r\n<p> learn more at<span style=\"text-decoration: underline;\"> http://www.debra.org/whatiseb</span></p>','postkdyOP6'),
('9','1','The Increasing Problem of Chronic Wounds and Their Medtech Solutions',NULL,'Wounds have many different sources, etiologies and forms and, therefore, demand a range of approaches. By virtue of these differences, they have considerably different costs.','<p><span>Wounds have many different sources, etiologies and forms and, therefore, demand a range of approaches. By virtue of these differences, they have considerably different costs. At the top of the list of wound culprits driving up cost is the category of chronic wounds....</span></p>\r\n<p><span style=\"text-decoration: underline;\">http://healthworkscollective.com/patrickdriscoll/155971/increasing-problem-chronic-wounds-and-their-medtech-solutions</span></p>\r\n<p><span><br /></span></p>','postsxeL1B'),
('10','1','High blood sugar levels linked to increased wound complications after surgeryhttp://www.sciencecodex.com/high_blood_sugar_levels_linked_to_increased_wound_complications_after_surgery-120319',NULL,'The risk of serious wound complications is more than three times higher for patients who have high blood glucose before and after surgery, and in those with poor long-term diabetes control.','<p><span>....among patients undergoing surgery for chronic wounds related to diabetes, the risk of wound-related complications is affected by how well the patient\'s blood sugar levels are controlled before surgery. </span></p>\r\n<p><span style=\"text-decoration: underline; line-height: 1.5em;\">http://www.sciencecodex.com/high_blood_sugar_levels_linked_to_increased_wound_complications_after_surgery-120319</span></p>','postMixYiw'),
('2','1','What is a calcium alginate?',NULL,'These are non-woven fiber dressings in sheet or rope form that are derived from seaweed and are absorbent.  When wound drainage makes contact with these dressings, a gel substance often forms.  This gel provides the moisture needed for optimal wound healing','<p><span style=\"text-decoration: underline;\"><a href=\"http://admedonline.com/index.php?controller=search&amp;controller=search&amp;orderby=position&amp;orderway=desc&amp;search_query=calcium+alginate&amp;_jsuid=4202751393&amp;ff9681f45fc75c2317749ca6d18afc4e=WQO1Y2eHVHHZhz0VQ9uqdWgy6XM6LgvfXnJOnEHnEs%2BoTCQOBxM4Ehgl0mU1dKoVRnzXRGcN0TZd2eRYOYLxVoXZIYcroAVRtnE2bHSjVyP%2FNTWyvqyeS2omCuyduaF1%2B%2B4%2FU6V95PT9AGLKxGp7OEaMlUExxo%2FG2U40Nfu3cTXl204eZh0ywZcdj1GpGTAFIUGi8BocEWOFw1JuWgubHB%2Bg4Dv4UoYwakP%2FAEvhbGpsCiUmG3d08XyPmGlXnKvuSLYePGx2JVE0i9Z%2BP5QBGvXUx3z9eY4Fe58mW5czqKvrY4H17xDPMR2yYaWzVjLlsIrkFV2Zwfthj2xbDFva6Ycv2xFQXav0CrrH%2FBDR3g%2BIDHMjgcv2P2UYYI1lb19Be7EBhcTzyDTVZp7IQ2g1NtFjpscfhnsrv7%2ByJDaWR0vVTZ8rmcvD%2B0qgIrAO3Q5HIR2j9P7aMxpbkEjCJxmhN27kAKUlOSevUfTJr9PWtx6adxpntTIDNShG5tvp4bao6IdvDWteJ8K88LaUIiPBX1Ed0L8d%2BHMWKNi4idDdWI%2Bsd4t6qao%2F3up%2Bsn%2Bo6XnK4m377%2Foh3bBZnmnYsldo%2F7qB8l4GixlVtG00qd5gefqjSjtqHzikbUL7SI8dsYKX90ngL9S6B5A%2B%2FelZ1MlqUJQ%2B7ww%2F22gGVmBn79WX%2B7M%3D000499&amp;unpoco_100602948=1&amp;__atuvc=2%7C21%2C26%7C22%2C0%7C23%2C0%7C24%2C9%7C25&amp;display=grid&amp;3f99a2f33f7744ef0eca694ec6b1a644=WQO1Y2eHVHHZhz0VQ9uqdVcTY9fBGPtYbEL2gqR7cBGemNpKeH9ceQrm2k5%2Ftipjli6jFXk8ffJfE5KdnKMXD%2BzCdeyNl%2FaCjK3UjNyX4mX%2FN%2BiEZtWLdKTperNMwtDWdR2BD7rp7T%2BzhzaDD7TnqK6ZPzkV36s9jA07SdW91bzsLhOaSs6jOeOBPNlw0TMy000135&amp;__utma=99182542.914549610.1368587736.1371680968.1371685194.34&amp;__utmb=99182542.10.10.1371685194&amp;__utmc=99182542&amp;__utmz=99182542.1371609405.31.2.utmcsr%3DAdmed+List%7Cutmccn%3D4fe0defa45-Amazon_Gift_Card_Winner6_18_2013%7Cutmcmd%3Demail%7Cutmctr%3D0_1e78225dda-4fe0defa45-&amp;_eventqueue=%7B%5C%22heatmap%5C%22%3A%5B%5D%2C%5C%22events%5C%22%3A%5B%5D%7D\"><span style=\"color: #000000;\"><span style=\"color: #ff9933;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\"><strong>Calcium Alginate</strong></span></span></span></span></a></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\">These are non-woven fiber dressings in sheet or rope form that are derived from seaweed and are absorbent. When wound drainage makes contact with these dressings, a gel substance often forms. This gel provides the moisture needed for optimal wound healing</span></span></span></p>\r\n<p> </p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #6ab4e4;\"><span style=\"font-family: Arial, serif;\">Drainage requirement: </span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\">moderate to heavy.</span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #6ab4e4;\"><span style=\"font-family: Arial, serif;\">Indicated for: </span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\">any kind of wound having moderate to heavy drainage</span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #6ab4e4;\"><span style=\"font-family: Arial, serif;\">Action: </span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\">absorbs excess drainage </span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #6ab4e4;\"><span style=\"font-family: Arial, serif;\">Contraindications: </span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\">do not use on dry wounds</span></span></span></p>\r\n<p> </p>\r\n<p> </p>\r\n<p><span style=\"text-decoration: underline;\"><a href=\"http://admedonline.com/index.php?controller=search&amp;controller=search&amp;orderby=position&amp;orderway=desc&amp;search_query=calcium+silver&amp;_jsuid=4202751393&amp;ff96