9S6B5A%25252B%25252FelZ1MlqUJQ%25252B7ww%25252F22gGVmBn79WX%25252B7M%25253D000499%2526unpoco_100602948%253D1%2526__atuvc%253D2%25257C21%25252C26%25257C22%25252C0%25257C23%25252C0%25257C24%25252C9%25257C25%25263f99a2f33f7744ef0eca694ec6b1a644%253DWQO1Y2eHVHHZhz0VQ9uqdVcTY9fBGPtYbEL2gqR7cBGemNpKeH9ceQrm2k5%25252Ftipjli6jFXk8ffJfE5KdnKMXD%25252BzCdeyNl%25252FaCjK3UjNyX4mX%25252FN%25252BiEZtWLdKTperNMwtDWdR2BD7rp7T%25252BzhzaDD7TnqK6ZPzkV36s9jA07SdW91bzsLhOaSs6jOeOBPNlw0TMy000135%2526__utma%253D99182542.914549610.1368587736.1371680968.1371685194.34%2526__utmb%253D99182542.30.10.1371685194%2526__utmc%253D99182542%2526__utmz%253D99182542.1371609405.31.2.utmcsr%25253DAdmed%252BList%25257Cutmccn%25253D4fe0defa45-Amazon_Gift_Card_Winner6_18_2013%25257Cutmcmd%25253Demail%25257Cutmctr%25253D0_1e78225dda-4fe0defa45-%2526_eventqueue%253D%25257B%25255C%252522heatmap%25255C%252522%25253A%25255B%25255D%25252C%25255C%252522events%25255C%252522%25253A%25255B%25255D%25257D%2526display%253Dgrid%5C%22%7D%5D%2C%5C%22events%5C%22%3A%5B%5D%7D\"><span style=\"text-decoration: underline;\"><span style=\"color: #000000;\"><span style=\"color: #ff9933;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\"><strong>Calcium Alginate with Honey</strong></span></span></span></span></span></a></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\">This alginate product combines active Leptospermum honey into a calcium alginate sheet. It has the same drainage requirements and indications as a plain calcium alginate with honey added for natural cleansing and likely bacterial reduction in the wound.</span></span></span></p>\r\n<p> </p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #6ab4e4;\"><span style=\"font-family: Arial, serif;\">Action: </span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\">absorbs excess drainage, forms a gel to assist in maintaining necessary moisture and optimal wound healing, cleanses and debrides, lowers overall Ph, strong evidence of bacteria reduction</span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #6ab4e4;\"><span style=\"font-family: Arial, serif;\">Contraindications: </span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\">sensitivity to honey</span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #6ab4e4;\"><span style=\"font-family: Arial, serif;\">Indicated for: </span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\">diabetic foot ulcers, pressure ulcers, partial thickness 1</span></span><span style=\"color: #808080;\"><sup><span style=\"font-family: Arial, serif;\">st</span></sup></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\"> and 2</span></span><span style=\"color: #808080;\"><sup><span style=\"font-family: Arial, serif;\">nd</span></sup></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\"> degree burns, donor sites, post-surgical wounds that fail to heal properly</span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #6ab4e4;\"><span style=\"font-family: Arial, serif;\">Example: </span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\">Medihoney</span></span></span></p>\r\n<p> </p>\r\n<p> </p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #ff9933;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\"><strong>Dressing changes:</strong></span></span></span><span style=\"color: #ff9933;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\"> Alginate dressings are usually changed daily to avoid the excess moisture that can prevent or slow wound healing.</span></span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #ff9933;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\"><strong>Usage:</strong></span></span></span><span style=\"color: #ff9933;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\"> A secondary dressing is necessary to hold in place. </span></span></span></span></p>\r\n<p> </p>\r\n<p align=\"CENTER\"><span style=\"color: #000000;\"><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Calcium alginate dressings can be found under the</span></span></span><span style=\"color: #6ab4e4;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\"><em><strong>Absorbency</strong></em></span></span></span><span style=\"color: #808080;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">category on this website</span></span></span></span></p>\r\n<p> </p>','post0Wk7Is'),
('11','1','Understanding Wound Care Terminology',NULL,'Doctors, nurse practitioners and nurses often use unfamiliar words which can cause misunderstanding by patients having chronic wounds. ','<p>Doctors, nurse practitioners and nurses often use unfamiliar words which can cause misunderstanding by patients having chronic wounds. </p>\r\n<p>See a complete list of wound care terminology.</p>\r\n<p><span style=\"text-decoration: underline;\"><span style=\"line-height: 1.5em;\">http://admedonline.com/content/6-wound-terminology</span></span></p>','post6WCLcY');
