('68','1','1','Ostomy, Urostomy Products and  Supplies','Products provided include:\r\n One-Piece Pouches,\r\n Two-Piece Pouches,\r\n Urostomy Pouches,\r\n Wafers,\r\n Skin Barriers,\r\n Skin prep products,\r\n Deodorizing drops,  \r\n    .....and much more\r\n \r\nWe carry Hollister, Convatec, Perfect Choice, generic brands and more to suit all consumers.  There are thousands of sizes, styles and products to choose from to suit your individual needs.\r\n\r\nPlease call our ostomy department toll free at (877) 278-3088 for the best in personalized service.','ostomy-urostomy-products-and-supplies',NULL,NULL,NULL),
