INSERT INTO `ps_cms_lang` VALUES
('1','1','Delivery','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<h2>Shipments and returns</h2><h3>Your pack shipment</h3><p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p><p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>','delivery'),
('1','2','Delivery','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<h2>Shipments and returns</h2><h3>Your pack shipment</h3><p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p><p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>','delivery'),
('1','3','Lieferung','Unsere Lieferbedingungen','Bedingungen, Lieferung, Frist, Versand, Verpackung','<h2>Versand und Rücknahme</h2><h3>Ihre Versandverpackung</h3><p>Pakete werden normalerweise 2 Tage nach Zahlungseingang mit UPS mit Bestellverfolgemöglichkeit und Ablieferung ohne Unterschrift geliefert. Wenn Sie lieber eine UPS-Sendung per Einschreiben erhalten möchten, entstehen zusätzliche Kosten. Bitte kontaktieren Sie uns, bevor Sie dieses Liefermethode wählen. Wir senden Ihnen einen Link für die Bestellverfolgung unabhängig davon, welche Liefermethode Sie wählen.</p><p>Die Versandkosten beinhalten Lade- und Verpackungsgebühren sowie die Portokosten. Die Verladegebühren stehen fest, wobei Transportkosten schwanken, je nach Gesamtgewicht des Pakets. Wir raten Ihnen, mehrere Artikel in einer Bestellung zusammenzufassen. Wir können zwei verschiedene Bestellungen nicht zusammenlegen, und die Versandkosten werden separat für jede Bestellung gerechnet. Ihr Paket wird auf Ihr Risiko versandt, aber zerbrechliche Ware wird besonders sorgsam behandelt.<br /><br />Die Versandschachteln sind weit geschnitten und ihre Ware wird gut geschützt verpackt.</p>','Lieferung'),
('1','4','Entrega','Nuestras condiciones de entrega','condiciones, plazos de entrega, transporte, paquetería','<h2><span id=\"result_box\"><span style=\"background-color: #ffffff;\" title=\"Livraisons et retours\">shipping & Returns</span></span></h2>\r\n<h3><span id=\"result_box\"><span style=\"background-color: #ffffff;\" title=\"Le transport de votre colis\">El transporte de su paquete</span></span></h3>\r\n<p><span id=\"result_box\"><span style=\"background-color: #ffffff;\" title=\"Les colis sont généralement expédiés en 48h après réception de votre paiement.\">Los paquetes son generalmente enviados en 48 horas después de la recepción de su pago. </span><span style=\"background-color: #ffffff;\" title=\"Le mode d\'expédition standard est le Colissimo suivi, remis sans signature.\">La moda es el estándar expédition Colissimo seguido, entrega sin firma. </span><span style=\"background-color: #ffffff;\" title=\"Si vous souhaitez une remise avec signature, un coût supplémentaire s\'applique, merci de nous contacter.\">Si desea una entrega con la firma, un cargo adicional, gracias al contacto con nosotros. </span><span style=\"background-color: #ffffff;\" title=\"Quel que soit le mode d\'expédition choisi, nous vous fournirons dès que possible un lien qui vous permettra de suivre en ligne la livraison de votre colis.\">Sea cual sea el método de envío seleccionado, vamos a presentar lo antes posible, un vínculo que le permite rastrear el envío en línea de su paquete.<br /><br /></span><span style=\"background-color: #ffffff;\" title=\"Les frais d\'expédition comprennent l\'emballage, la manutention et les frais postaux.\">Gastos de envío incluyen el embalaje, la manipulación y envío. </span><span style=\"background-color: #ffffff;\" title=\"Ils peuvent contenir une partie fixe et une partie variable en fonction du prix ou du poids de votre commande.\">Pueden contener un fijo y una parte variable basado en el precio o el peso de su solicitud. </span><span style=\"background-color: #ffffff;\" title=\"Nous vous conseillons de regrouper vos achats en une unique commande.\">Le recomendamos que para consolidar sus compras en un solo comando. </span><span style=\"background-color: #ffffff;\" title=\"Nous ne pouvons pas grouper deux commandes distinctes et vous devrez vous acquitter des frais de port pour chacune d\'entre elles.\">No podemos grupo de dos órdenes distintos y hay que pagar gastos de envío para cada uno. </span><span style=\"background-color: #ffffff;\" title=\"Votre colis est expédié à vos propres risques, un soin particulier est apporté au colis contenant des produits fragiles..\">Su paquete es enviado a su propio riesgo, se presta especial atención a las parcelas que contienen objetos frágiles ..<br /><br /></span><span style=\"background-color: #ffffff;\" title=\"Les colis sont surdimensionnés et protégés.\">Los paquetes son de gran tamaño y protegidas.</span></span></p>','entrega'),
('1','5','Livraison','Nos conditions générales de livraison','conditions, livraison, délais, transport, colis','<h2>Livraisons et retours</h2><h3>Le transport de votre colis</h3><p>Les colis sont g&eacute;n&eacute;ralement exp&eacute;di&eacute;s en 48h apr&egrave;s r&eacute;ception de votre paiement. Le mode d\'expédition standard est le Colissimo suivi, remis sans signature. Si vous souhaitez une remise avec signature, un co&ucirc;t suppl&eacute;mentaire s\'applique, merci de nous contacter. Quel que soit le mode d\'expédition choisi, nous vous fournirons d&egrave;s que possible un lien qui vous permettra de suivre en ligne la livraison de votre colis.</p><p>Les frais d\'exp&eacute;dition comprennent l\'emballage, la manutention et les frais postaux. Ils peuvent contenir une partie fixe et une partie variable en fonction du prix ou du poids de votre commande. Nous vous conseillons de regrouper vos achats en une unique commande. Nous ne pouvons pas grouper deux commandes distinctes et vous devrez vous acquitter des frais de port pour chacune d\'entre elles. Votre colis est exp&eacute;di&eacute; &agrave; vos propres risques, un soin particulier est apport&eacute; au colis contenant des produits fragiles..<br /><br />Les colis sont surdimensionn&eacute;s et prot&eacute;g&eacute;s.</p>','livraison'),
('1','6','Consegna','I nostri termini e condizioni di consegna','condizioni, consegna, tempo, spedizione, pacco','<h2>Spedizioni e resi</h2><h3>Spedizione del tuo pacco</h3><p>I pacchi sono solitamente spediti entro 2 giorni dopo il ricevimento del pagamento e inviati tramite UPS con controllo e consegna senza firma. Se preferisci una consegna con UPS Extra con richiesta di firma, sarà applicato un costo aggiuntivo, pertanto contattaci prima di scegliere questo mezzo. Qualunque tipo di spedizione tu scelga, ti garantiremo un link per controllare online il percorso del tuo pacco.</p><p>Le spese di spedizione comprendono le spese di imballaggio e affrancatura. Le spese di imballaggio sono fisse, mentre quelle di trasporto variano in base al peso totale della spedizione. Ti consigliamo di raggruppare i tuoi articoli in un unico ordine. Non possiamo raggruppare due ordini distinti eseguiti separatamente, e ad ognuno di esso saranno applicate le spese di spedizione. Il tuo pacco sarà inviato sotto la tua responsabilità, ma un\'attenzione particolare è riservata agli oggetti fragili.<br /><br />Le scatole hanno dimensioni ragionevoli e i tuoi articoli sono ben protetti.</p>','consegna'),
('2','1','Legal Notice','Legal notice','notice, legal, credits','<h2>Legal</h2><h3>Credits</h3><p>Concept and production:</p><p>This Web site was created using <a href=\"http://www.prestashop.com\">PrestaShop</a>&trade; open-source software.</p>','legal-notice'),
('2','2','Legal Notice','Legal notice','notice, legal, credits','<h2>Legal</h2><h3>Credits</h3><p>Concept and production:</p><p>This Web site was created using <a href=\"http://www.prestashop.com\">PrestaShop</a>&trade; open-source software.</p>','legal-notice'),
('2','3','Rechtliche Hinweise','Rechtliche Hinweise','Hinweise, rechtlich, Gutscheine','<h2>Legal</h2><h3>Credits</h3><p>Konzept und Gestaltung:</p><p>Diese Webseite wurde hergestellt unter Verwendung von <a href=\"http://www.prestashop.com\">PrestaShop</a>&trade; open-source software.</p>','rechtliche-hinweise'),
('2','4','Aviso legal','Aviso legal','términos, condiciones y créditos fotográficos','<h2><span id=\"result_box\"><span style=\"background-color: #ffffff;\" title=\"Mentions légales\">Pie de imprenta</span></span></h2>\r\n<h2><span id=\"result_box\"><span style=\"background-color: #ffffff;\" title=\"Mentions légales\"> </span></span><span id=\"result_box\"><span style=\"background-color: #ffffff;\" title=\"Crédits\">Créditos</span></span></h2>\r\n<h3><span id=\"result_box\"></span></h3>\r\n<p><span id=\"result_box\"><span style=\"background-color: #ffffff;\" title=\"Crédits\"><br /></span><span style=\"background-color: #ffffff;\" title=\"Concept et production :\">Concepto y producción:<br /><br /></span><span style=\"background-color: #ffffff;\" title=\"Ce site internet a été réalisé en utilisant la solution open-source PrestaShop™ .\">Este sitio web fue creado utilizando la solución de código abierto <a href=\"http://www.prestashop.com\" target=\"_blank\">PrestaShop</a>™.</span></span></p>','aviso-legal'),
('2','5','Mentions légales','Mentions légales','mentions, légales, crédits','<h2>Mentions l&eacute;gales</h2><h3>Cr&eacute;dits</h3><p>Concept et production :</p><p>Ce site internet a &eacute;t&eacute; r&eacute;alis&eacute; en utilisant la solution open-source <a href=\"http://www.prestashop.com\">PrestaShop</a>&trade; .</p>','mentions-legales'),
('2','6','Nota Legale','Nota legale','nota, legale, crediti','<h2>Legale</h2><h3>Crediti</h3><p>Creazione e produzione:</p><p>Questo sito web è stato realizzato usando un software open-source<a href=\"http://www.prestashop.com\">PrestaShop</a>&trade;.</p>','nota-legale'),
('3','1','Terms and conditions of use','Our terms and conditions of use','conditions, terms, use, sell','<h4>Are you under a doctor\'s care for an open wound?</h4>\r\n<p>Please be advised that many products shown on this site are covered by Medicare B or private insurance policies. To find out about what your insurance will cover, please call Wound Care Resources at (888) 287-9797 or go to our <a href=\"http://www.woundcareresources.net/\" target=\"new\"><strong>website</strong></a>. If Wound Care Resources bills your insurance for wound care dressings, anything purchased on this site will be packed along with covered items and shipped for a reduced shipping charge of $5.00. </p>\r\n<h4>Shipping and Handling</h4>\r\n<p><strong>We specialize in getting your products to you quickly</strong>.<br />Once an order is received it is processed within 24 to 36 hours during our business hours Monday-Friday 8:00-5:00 CST. Orders placed on Saturday or Sunday will be shipped on the following business day.</p>\r\n<p>Advanced Medical Resources routinely ships by UPS or FedEx. The United States Postal Service may be utilized for very small orders.  Most orders should be received in 2-5 business days after processing.</p>\r\n<p>The following holidays will be observed by our office when standard shipping service is not available: Memorial Day, Independence Day, Labor Day, Thanksgiving Day, day after Thanksgiving, Christmas Day, New Year’s Eve, New Years Day.</p>\r\n<h4><strong>Returns and Exchange Policy</strong></h4>\r\n<p> </p>\r\n<p align=\"center\">• Only unopened, unused packages purchased from us and in perfect resale condition<br />  may be returned. <br />• A restocking fee of 15% will apply.<br />• Products special ordered or not routinely carried by Advanced Medical Resources <br />  may not be returned for credit. <br />• All returns must be mailed back to us within 30 days of purchase.</p>\r\n<p><strong>Please use the following procedure</strong>:<br />Call the office to obtain an RMA number or use our <a href=\"http://www.admedonline.com/returns.asp\"><strong>return form</strong></a>.</p>\r\n<ol>\r\n<li>pack items carefully</li>\r\n<li>Call us at (866) 755-2677 to obtain an RMA number or use our return form. This number must be clearly placed outside the box.  Packages received without an RMA number will not be accepted and will be returned to you</li>\r\n<li>Insure your package for the cost of your items</li>\r\n<li>Send returns to: <br />Advanced Medical Resources<br />4 Newbern Highway <br />Yorkville, TN 38389</li>\r\n</ol>\r\n<p> </p>\r\n<p><strong>Returned products will be inspected.</strong><br />Once your products have been considered to be in perfect resalable condition, your credit card will be credited for the returned items less the restocking fee.  All shipping charges are at the customer’s expense and are not refundable.</p>\r\n<p><strong>Returns due to product defect or incorrect products sent</strong><br />If products were sent in error or are defective, Advanced Medical Resources must be contacted within two days of delivery for an adjustment to be made.  We will issue you a Return Merchandise Authorization number to ship the product back to our office, and resend the correct items at no extra cost for shipping and handling.  Please follow these steps:</p>\r\n<p>To request a return please use our <a href=\"http://www.admedonline.com/returns.asp\"><strong>return form</strong></a> or call our toll free number (866) 755-2677 with the following information:</p>\r\n<ol>\r\n<li>Customer name</li>\r\n<li>Date of purchase</li>\r\n<li>Original invoice number</li>\r\n<li>Product item number</li>\r\n<li>Product name</li>\r\n<li>Reason for return.</li>\r\n</ol>\r\n<p> </p>\r\n<p>Upon verification of the above information, our returns department will assign a return authorization number and process a request for a UPS pickup.</p>\r\n<p><strong>Returns due to shipping damage<br /></strong>Damaged boxes should not be accepted upon delivery.  However, if you do accept or receive a damaged box and the contents have been damaged, please use our <a href=\"http://www.admedonline.com/contact.asp\"><strong>contact form</strong></a> or call our toll free number at (866) 755-2677.</p>\r\n<p align=\"center\"> </p>\r\n<h4>General Policies</h4>\r\n<p> </p>\r\n<p><strong>Patients who have Medicare or commercial insurance </strong>should contact Wound Care Resources at (888) 287-9797 to determine if their insurance will cover the cost of wound care supplies.  You may also visit the website at<strong> <a href=\"http://www.woundcareresources.net/\" target=\"new\">www.woundcareresources.net</a></strong>.</p>\r\n<p><strong>Product Availability:</strong><br />Advanced Medical Resources cannot be liable for delays caused by a shortage of raw materials, manufacturing difficulties, delivery delays, labor disputes or any other issues beyond our control.</p>\r\n<p><strong>Backorders:</strong><br />Advanced Medical works hard to prevent back orders.  However, if a backorder occurs, the shipping cost will be adjusted for the cost of the order actually shipped, and your backorder shipping will be sent to you at a nominal charge.</p>\r\n<p><strong>Substitutions:</strong><br />Brand name products that have a chemical or biological effect on healing (primary dressings) will not be substituted without contacting the customer by phone or email.</p>\r\n<p>All stock dressings that are used to hold other dressings in place (secondary dressings like gauze, gauze sponges, gauze rolls, ABD pads, etc.) have been chosen by Advanced Medical for quality. Substitutions of these types of products will not affect the healing outcome of the wound, and in some rare cases a comparable product with a different brand name may be sent to fill the entire order in a timely manner.</p>\r\n<p><strong>Sales tax will be applied in accordance with state and federal laws</strong>.</p>\r\n<p><strong>Privacy Policy</strong><br />You may be confident that your personal information will be protected.<br />No personal information will be provided or sold to any other marketing organizations. </p>\r\n<p><strong>Volume Discounts Available</strong><br />Please call our office for questions regarding volume discounting. AMR routinely offers volume discounts to medical facilities ordering products in larger quantities.  Valid tax IDs and additional information is required. </p>\r\n<p><strong>Special orders, contract orders and business to business orders are non-returnable.</strong></p>\r\n<p>Please call our office at <strong>(866) 755-2677</strong> with questions regarding volume discounting, and ask for Jackie Scott.  You may also contact her at<strong> <a href=\"mailto:jscott@admedonline.com\">jscott@admedonline.com</a></strong>.</p>','terms-and-conditions-of-use'),
