('6','1','Wound Terminology',NULL,NULL,'<p class=\"bodytxt\"><strong>Amorphous –</strong><strong> </strong>Without a clear shape as in a wound dressing in gel form</p>\r\n<p class=\"bodytxt\"><strong>Antimicrobial –</strong><strong> </strong>An agent that inhibits the growth of bacteria</p>\r\n<p class=\"bodytxt\"><strong>Arterial Ulcer</strong> – Related to the presence of arterial occlusive disease.  Presenting symptoms mainly involve pain and tissue loss.</p>\r\n<p class=\"bodytxt\"><strong>Autolytic Debridement</strong> - Removal of devitalized tissue through normal wound exudate or through the use of any topical dressing or preparation that encourages moisture retention or by the body’s own mechanisms</p>\r\n<p class=\"bodytxt\"><strong>Bedsore</strong> – The traditional name for a pressure ulcer. Also called a decubitus ulcer.</p>\r\n<p class=\"bodytxt\"><strong>Beefy Red</strong> – A term used to describe a healthy looking wound with good blood supply</p>\r\n<p class=\"bodytxt\"><strong>Blanching</strong> – To become white with pressure</p>\r\n<p class=\"bodytxt\"><strong>Biocompatible</strong> – refers to the ability of a product to perform its desired function without eliciting any undesirable effects</p>\r\n<p class=\"bodytxt\"><strong>Cellulitis</strong> – Inflammation of tissue characterized by redness.  Signifies a spreading infection.</p>\r\n<p class=\"bodytxt\"><strong>Chemical Debridement</strong> – The removal of dead or devitalized tissue by using enzymatic debriding agents.</p>\r\n<p class=\"bodytxt\"><strong>Chronic Wound</strong> – A wound that takes longer than normal to heal due to underlying conditions such as pressure, diabetes, poor circulation, immune deficiencies or infection.</p>\r\n<p class=\"bodytxt\"><strong>Contraction</strong> – The pulling together of wound edges/margins in the healing process.</p>\r\n<p class=\"bodytxt\"><strong>CWOCN</strong> – Same as “ET Nurse” (Certified wound, ostomy, continence nurse).</p>\r\n<p class=\"bodytxt\"><strong>CWS</strong> – Certified Wound Specialist</p>\r\n<p class=\"bodytxt\"><strong>Debride</strong> – to remove dead or devitalized tissue</p>\r\n<p class=\"bodytxt\"><strong>Debridement</strong> – Removal of dead or devitalized tissue.</p>\r\n<p class=\"bodytxt\"><strong>Decubitus Ulcer</strong> – The Latin term for a pressure ulcer. (Sometimes referred to as a “decub.”)</p>\r\n<p class=\"bodytxt\"><strong>Dehisced</strong> – Describes a surgical wound which has broken open or is not healing properly</p>\r\n<p class=\"bodytxt\"><strong>Denuded</strong> – Loss of epidermis.</p>\r\n<p class=\"bodytxt\"><strong>Depth</strong> – Distance from the wound’s surface downward. The last measurement in wound description in centimeters.</p>\r\n<p class=\"bodytxt\"><strong>Dermis</strong> – The second layer of skin that contains hair follicles, sweat glands, sebaceous glands, blood vessels and lymph vessels: involved in stage 2, 3, and 4 pressure ulcers as well as partial and full thickness wounds.</p>\r\n<p class=\"bodytxt\"><strong>Edema</strong> – Observable swelling from fluid accumulation in body tissues</p>\r\n<p class=\"bodytxt\"><strong>Enterostomal Therapy Nurse or Certified Wound, Ostomy, Continence Nurse</strong> – <br /> Often referred to as “ET nurse.”  Nurse who provides Care expertise to patients with abdominal stomas, draining  wounds and fistulas, incontinence and general wound care.</p>\r\n<p class=\"bodytxt\"><strong>Epidermis</strong> – The outer cellular layer of the skin</p>\r\n<p class=\"bodytxt\"><strong>Epiboly</strong> – edges of the top layer of the epidermis roll down to cover lower edge of epidermis, causing the inability of epithelial cells to migrate from wound edges. Wound healing cannot take place in this circumstance.</p>\r\n<p class=\"bodytxt\"><strong>Epithelialization –</strong><strong> </strong>Regeneration of the epidermis across a wound surface</p>\r\n<p class=\"bodytxt\"><strong>Erythema</strong> – Redness of the skin surface produced by widening of the blood vessels.</p>\r\n<p class=\"bodytxt\"><strong>Eschar</strong> – Thick, leathery dead or devitalized tissue.</p>\r\n<p class=\"bodytxt\"><strong>Etiology</strong> – The science and study of the causes of diseases and their mode of operation.</p>\r\n<p class=\"bodytxt\"><strong>ET nurse</strong> – Commonly used term for an Enterostomal Therapy Nurse.</p>\r\n<p class=\"bodytxt\"><strong>Excoriation</strong> – Linear scratches on the skin.</p>\r\n<p class=\"bodytxt\"><strong>Exudate</strong> – Accumulation of fluids in a wound. </p>\r\n<p class=\"bodytxt\"><strong>Fenestrated –</strong><strong> </strong>sliced or cut open</p>\r\n<p class=\"bodytxt\"><strong>Fibrous Tissue</strong> – Tightly bound yellow film found on the granulation tissue surface composed of or containing fibroblasts</p>\r\n<p class=\"bodytxt\"><strong>Friable</strong> – refers to a delicate wound that may bleed easily</p>\r\n<p class=\"bodytxt\"><strong>Friction</strong> – Surface damage caused by skin rubbing against another surface.</p>\r\n<p class=\"bodytxt\"><strong>Full Thickness Wound</strong> – Tissue destruction extending through the dermis to involve subcutaneous tissue and possibly muscle/bone.</p>\r\n<p class=\"bodytxt\"><strong>Granulation Tissue</strong> – The formation or growth of small blood vessels and connective tissue in a full thickness wound and a stage 3 and 4 pressure ulcer: beefy red, shiny, granular tissue which generally indicates healing.</p>\r\n<p class=\"bodytxt\"><strong>Growth Factors -</strong><strong> </strong>refers to naturally occurring substances capable of stimulating cellular growth and proliferation</p>\r\n<p class=\"bodytxt\"><strong>Hydrophilic</strong> – Attracting moisture</p>\r\n<p class=\"bodytxt\"><strong>Hydroactive –</strong><strong> </strong>Activated by moisture</p>\r\n<p class=\"bodytxt\"><strong>Hypertonic –</strong><strong> </strong>movement of water from a high H2O concentration inside the cell, to a low H2O concentration outside the cell. Hypertonic wound dressings pull water or exudate out of an area and create a moist environment that is more conducive to wound healing.</p>\r\n<p class=\"bodytxt\"><strong>Hypergranulation –</strong><strong> </strong>Increased thickness in the granular layer of the epidermis.</p>\r\n<p class=\"bodytxt\"><strong>Ionic exchange</strong><strong> </strong><strong>–</strong><strong> </strong>Denotes the processes of purification, separation, and decontamination.</p>\r\n<p class=\"bodytxt\"><strong>Infection</strong> – Overgrowth of microorganisms capable of tissue destruction and invasion, accompanied by local or systemic symptoms </p>\r\n<p class=\"bodytxt\"><strong>Inflammation</strong> – Defensive reaction to tissue injury: involves increased blood flow and capillary permeability Signs and symptoms include heat, redness, swelling and pain of the affected area.</p>\r\n<p class=\"bodytxt\"><strong>Inflammatory Phase</strong> – The first phase in the normal wound healing process that lasts approximately from time of the initial injury to four days post injury.</p>\r\n<p class=\"bodytxt\"><strong>Ischemia</strong> – A deficiency of blood supply due to functional constriction or obstruction of a blood vessel.</p>\r\n<p class=\"bodytxt\"><strong>Maceration</strong> – A “waterlogged” appearance of the area surrounding a wound which is an indication of excessive moisture or an inappropriate dressing or dressing application.   </p>\r\n<p class=\"bodytxt\"><strong>Macrophage</strong> – “Giant Eater:” eats up unwanted dead tissue, cleans the wound and releases chemicals.</p>\r\n<p class=\"bodytxt\"><strong>Mechanical Debridement</strong> – The removal of dead or devitalized tissue, for example by the use of wet-to-dry dressings, whirlpool or surgical debridement.</p>\r\n<p class=\"bodytxt\"><strong>Moisture Retentive Dressings</strong> – Dressings that allow wounds to remain moist.</p>\r\n<p class=\"bodytxt\"><strong>MMP’s –</strong><strong> </strong>Enzymes in chronic wounds which when imbalanced with their natural inhibitors can become destructive and delay the healing process.</p>\r\n<p class=\"bodytxt\"><strong>Necrotic</strong> – Dead</p>\r\n<p class=\"bodytxt\"><strong>Negative pressure</strong> – a vacuum-action that is used to reduce pressure around a wound, drawing out excess fluids and cellular wastes.</p>\r\n<p class=\"bodytxt\"><strong>Non-occlusive –</strong><strong> </strong>Allowing the passage of moisture and air</p>\r\n<p class=\"bodytxt\"><strong>Occlusive</strong> - A dressing that prevent the passage of air that can dry out a wound bed or to prevent unwanted or unneeded moisture from going into or out of an area. </p>\r\n<p class=\"bodytxt\"><strong>Osmotic</strong> – relating to osmosis: a physical process in which a solvent moves, without input of energy, across a semi-permeable membrane. This term relates to movement of wound fluid from one place to another.</p>\r\n<p class=\"bodytxt\"><strong>Osteomyelitis</strong> – Inflammation of the bone marrow and adjacent bone.</p>\r\n<p class=\"bodytxt\"><strong>Partial Thickness Wound</strong> – Tissue destruction through the epidermis extending into but not through the dermis.</p>\r\n<p class=\"bodytxt\"><strong>Periwound</strong> – Around the wound</p>\r\n<p class=\"bodytxt\"><strong>Permeability</strong> -  Ability to pass through</p>\r\n<p class=\"bodytxt\"><strong>Pressure Ulcer</strong> – An area of localized damage caused by ischemia due to pressure.</p>\r\n<p class=\"bodytxt\"><strong>Serous</strong> – Producting a serous secretion or containing serum</p>\r\n<p class=\"bodytxt\"><strong>Sinus tract</strong> – A pathway which can extend in any direction from the wound surface resulting in dead space</p>\r\n<p class=\"bodytxt\"><strong>Sodium Hypochlorite</strong> – a chemical compound frequently used as a disinfecting agent</p>\r\n<p class=\"bodytxt\"><strong>Slough –</strong> Necrotic tissue that is usually loose, stringy, yellow, tan, white or gray in color.</p>\r\n<p class=\"bodytxt\"><strong>Shear</strong> – Trauma caused by tissue layers sliding against each other.</p>\r\n<p class=\"bodytxt\"><strong>Stasis</strong> – Stagnation of blood caused by venous congestion.</p>\r\n<p class=\"bodytxt\"><strong>Staging</strong> – An anatomical description of depth used to describe pressure ulcers.</p>\r\n<p class=\"bodytxt\"><strong>Surgical Debridement</strong> – The removal of dead or devitalized tissue by a physician or trained healthcare professional at the bedside or in the operating room.</p>\r\n<p class=\"bodytxt\"><strong>Tunneling</strong> – Tissue destruction underlying intact skin along wound margins.</p>\r\n<p class=\"bodytxt\"><strong>Ulcer</strong><strong> </strong>– An open lesion or sore</p>\r\n<p class=\"bodytxt\"><strong>Undermining</strong> – Another term used to describe tunneling: tissue destruction underlying intact skin along wound margins</p>\r\n<p class=\"bodytxt\"><strong>Vasoconstriction</strong>- Dilation of blood vessels</p>\r\n<p class=\"bodytxt\"><strong>Vasodilation</strong> – Dilation of blood vessels</p>\r\n<p class=\"bodytxt\"><strong>Venous</strong> – pertaining to the veins.</p>\r\n<p class=\"bodytxt\"><strong>Venous Ulcer</strong> – Local losses of epidermis and variable levels of dermis and subcutaneous tissue occuring over or near the ankle and/or lateral lower leg.</p>\r\n<p class=\"bodytxt\"><strong>WOCN</strong> – An acronym for Wound, Ostomy, Continence Nurse<br /> </p>\r\n<p> </p>','wound-terminology'),
