('7','1','Product Terminology',NULL,NULL,'<p><strong><a href=\"http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare\">GAUZE ROLLS &amp; GAUZE SPONGES</a></strong></p>\r\n<p><strong>ANTIMICROBIAL GAUZE WRAP – ANTIMICROBIAL GAUZE SPONGE</strong><br /><br />Roll gauze impregnated with an <a href=\"http://www.admedonline.com/education.asp#antimicrobial\"><span style=\"text-decoration: underline;\">antimicrobial</span></a> substance to prevent contamination of a wound site.</p>\r\n<p><strong>Examples: <br />Bioguard roll gauze<br />Bioguard gauze sponge <br />Kerlix AMD </strong><br /><br /><strong>Indicated for</strong> <br />Use on any wound site to prevent infection from entering the wound site from the outside <br /><br /><strong>Action</strong> <br />Prevents infection by eliminating bacteria <br /><br /><strong>Contraindications</strong> <br />None known</p>\r\n<hr />\r\n<p> </p>\r\n<p><strong><a id=\"anasept\" name=\"anasept\"></a><a href=\"http://www.admedonline.com/proddetail.asp?prod=antimicrobial%5Fanasept%5Fspray\">ANASEPT SPRAY</a></strong><br /><br />Anasept is an extremely safe and gentle antimicrobial skin and wound cleanser with exceptionally rapid broad-spectrum bactericidal, fungicidal and virucidal properties.  It is a pure, colorless, isotonic, tissue-compatible solution and has a two-year shelf life.</p>\r\n<p>Anasept will eliminate bacteria and fungi within 2 minutes or less including resistant strains such as MRSA, VRE, Pseudomonas, Candida albicans and Aspergillus niger.  There is no known microbial resistance to Anasept.</p>\r\n<p>This product may be used as a wound cleanser and to prepare sites for IV fluids, dialysis, central lines and more.</p>\r\n<hr />\r\n<p><br /><a name=\"alginate\"></a><strong><a href=\"http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare\">CALCIUM ALGINATE DRESSINGS</a></strong><br /><strong>Secondary dressing should be used to cover </strong><br /><br /><a href=\"http://www.admedonline.com/education.asp#hydrophilic\"><span style=\"text-decoration: underline;\">Hydrophilic</span></a>, non-woven fiber dressings that are derived from seaweed and when contacted by wound <a href=\"http://www.admedonline.com/education.asp#exudate\"><span style=\"text-decoration: underline;\">exudate</span></a> form a gel mass in the wound.  These come in a sheet or rope form and are absorbent.</p>\r\n<p><strong>Examples: <br />Algicel <br />Melgisorb <br />Reliamed </strong><br /><br /><strong>Indicated for</strong> <br /><a href=\"http://www.admedonline.com/education.asp#partial_thkns\"><span style=\"text-decoration: underline;\">Partial thickness</span></a> and <a href=\"http://www.admedonline.com/education.asp#full_thkns\"><span style=\"text-decoration: underline;\">full thickness</span></a> wounds having moderate to heavy <a href=\"http://www.admedonline.com/education.asp#exudate\"><span style=\"text-decoration: underline;\">exudate</span></a>, Infected wounds, Filling cavities, tracts and<a href=\"http://www.admedonline.com/education.asp#undermining\"><span style=\"text-decoration: underline;\">undermining</span></a>, <a href=\"http://www.admedonline.com/education.asp#partial_thkns\"><span style=\"text-decoration: underline;\">Partial thickness</span></a> and <a href=\"http://www.admedonline.com/education.asp#full_thkns\"><span style=\"text-decoration: underline;\">full thickness</span></a> wounds <br /><br /><strong>Action</strong> <br />Absorbs excess <a href=\"http://www.admedonline.com/education.asp#exudate\"><span style=\"text-decoration: underline;\">exudate</span></a> while maintaining a moist wound environment Facilitates <a href=\"http://www.admedonline.com/education.asp#autolytic\"><span style=\"text-decoration: underline;\">autolytic debridement</span></a> of loose, <a href=\"http://www.admedonline.com/education.asp#necrotic\"><span style=\"text-decoration: underline;\">necrotic</span></a> tissue <br /><br /><strong>Contraindications</strong> <br />Dry wounds </p>\r\n<hr />\r\n<p><br /><a name=\"alginatesilver\"></a><strong><a href=\"http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare\">CALCIUM ALGINATE WITH SILVER</a></strong><br /><strong>Secondary dressing should be used to cover </strong><br /><br />Same composition and indications as calcium alginate with silver added for <a href=\"http://www.admedonline.com/education.asp#antimicrobial\"><span style=\"text-decoration: underline;\">antimicrobial</span></a> benefits.</p>\r\n<p><strong>Examples:<br />Silverlon CA <br />Algicel AG<br />Reliamed AG-CMC (hydrofiber)</strong></p>\r\n<p><strong>Indicated for</strong> <br />Draining wounds with signs of infection Filling cavities, tracts and <a href=\"http://www.admedonline.com/education.asp#undermining\"><span style=\"text-decoration: underline;\">undermining</span></a> <br /><br /><strong>Action</strong> <br />Absorbs excess <a href=\"http://www.admedonline.com/education.asp#exudate\"><span style=\"text-decoration: underline;\">exudate</span></a> while maintaining a moist wound environment Facilitates <a href=\"http://www.admedonline.com/education.asp#autolytic\"><span style=\"text-decoration: underline;\">autolytic debridement</span></a> of loose, <a href=\"http://www.admedonline.com/education.asp#necrotic\"><span style=\"text-decoration: underline;\">necrotic</span></a> tissue Decreases or eliminates bacterial load in an infected wound <br /><br /><strong>Contraindications:</strong> <br />Do not use with hydrogels <br />Should not be used with products that create an ionic exchange in the wound site <br />Cannot be used with enzymes (ie Santyl Collagenase) <br /><br /></p>\r\n<hr />\r\n<p><br /><strong><a name=\"alginatehoney\"></a><a href=\"http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare\">CALCIUM ALGINATE WITH HONEY</a></strong><br /><strong>Secondary dressing should be used to cover</strong> <br /><br />Active Leptospermum Honey impregnated into a calcium alginate pad.  As wound <a href=\"http://www.admedonline.com/education.asp#exudate\"><span style=\"text-decoration: underline;\">exudate</span></a> is absorbed, the alginate forms a gel to assist in maintaining a moist wound environment for optimal wound healing.  Alginate is removable in one piece.</p>\r\n<p><strong>Example:     <br />Medihoney </strong><br /><br /><strong>Indicated for</strong> diabetic foot ulcers, leg ulcers, pressure ulcers <br />1st and 2nd degree <a href=\"http://www.admedonline.com/education.asp#partial_thkns\"><span style=\"text-decoration: underline;\">partial thickness</span></a> burns <br />donor sites <br />traumatic and surgical wounds <br /><br /><strong>Action</strong> Cleanses and debrides lowers overall wound pH promotes a moisture-balanced environment eliminates bacteria and multi-resistant bacteria with natural honey</p>\r\n<hr />\r\n<p><br /><strong><a name=\"collagen\"></a><a href=\"http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare\">COLLAGEN DRESSINGS</a></strong><br /><br />These dressings come in pads, gels or particles and promote the deposit of newly formed collagen in the wound bed. They can be used on any type of wound with any type of drainage. Some specific brands require the wound to be free of <a href=\"http://www.admedonline.com/education.asp#necrotic\"><span style=\"text-decoration: underline;\">necrotic</span></a> tissue.</p>\r\n<p><strong>Examples: <br />pads – Promogran Prisma, Promogran Matrix (collagen with silver), BioPad, Fibracol Plus (alginate/collagen combination) <br />gel – Stimulen Gel <br />powder – Stimulen </strong><br /><br /><strong></strong><strong>Indicated for</strong> <br />Any type of wound with minimal, moderate or heavy drainage Some specific brands require the wound to be free of <a href=\"http://www.admedonline.com/education.asp#necrotic\"><span style=\"text-decoration: underline;\">necrotic</span></a> tissue <br /><br /><strong>Action</strong> <br />Provides a moist healing environment <br />Some brands reduce destructive elements in wound fluid to “kick-start” healing while allowing the patient’s <a href=\"http://www.admedonline.com/education.asp#growth\"><span style=\"text-decoration: underline;\">growth factors</span></a> to effectively heal the wound Promotes tissue <a href=\"http://www.admedonline.com/education.asp#granulation\"><span style=\"text-decoration: underline;\">granulation</span></a> and <a href=\"http://www.admedonline.com/education.asp#epithelialization\"><span style=\"text-decoration: underline;\">epithelialization</span></a> Burns Grafts <br /><br /><strong></strong><strong>Contraindications</strong> <br />none known </p>\r\n<hr />\r\n<p><br /><strong><a id=\"hydro\" name=\"hydro\"></a><a href=\"http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare\">HYDROCOLLOID DRESSINGS</a></strong><br /><strong>Can be either a primary or a secondary dressing </strong><br /><br />Wafer-type dressings that contain <a href=\"http://www.admedonline.com/education.asp#hydroactive\"><span style=\"text-decoration: underline;\">hydroactive</span></a> particles which, when in contact with wound <a href=\"http://www.admedonline.com/education.asp#exudate\"><span style=\"text-decoration: underline;\">exudate</span></a>, form a fluid/gel environment over the wound bed.  They can be self-adhering  with a surface that repells water, bacteria and other outside contaminants.  They are considered <a href=\"http://www.admedonline.com/education.asp#occlusive\"><span style=\"text-decoration: underline;\">occlusive</span></a> or semi-<a href=\"http://www.admedonline.com/education.asp#occlusive\"><span style=\"text-decoration: underline;\">occlusive</span></a>.</p>\r\n<p><strong>Examples: <br />Tegaderm Thin <br />Reliamed border sacral <br />Reliamed beveled <br />Flexicol bordered <br />Medihoney sheet (hydrocolloid with honey) <br />Medihoney tube  </strong> <br /><br /><strong>Indicated for</strong> <br /><a href=\"http://www.admedonline.com/education.asp#partial_thkns\"><span style=\"text-decoration: underline;\">partial thickness</span></a> to shallow <a href=\"http://www.admedonline.com/education.asp#full_thkns\"><span style=\"text-decoration: underline;\">full thickness</span></a> wounds <br /><br /><strong>Action</strong> <br />maintains a moist wound environment provides protection and insulation to a healing wound facilitates <a href=\"http://www.admedonline.com/education.asp#autolytic\"><span style=\"text-decoration: underline;\">autolytic debridement</span></a> <br /><br /><strong>Contraindications for use</strong> <br />infected wounds <br />wounds with heavy <a href=\"http://www.admedonline.com/education.asp#exudate\"><span style=\"text-decoration: underline;\">exudate</span></a>, deep cavities, sinus tracts (unless used as a secondary dressing over packing) <br />Burns <br />Grafts </p>\r\n<hr />\r\n<p><br /><strong><a name=\"hydrofera\"></a><a href=\"http://www.admedonline.com/proddetail.asp?prod=foam%5Fhydrofera\">HYDROFERA BLUE</a></strong> <br />Foam impregnated with Methylene Blue and Gentian Violet <br /><br /><strong></strong><strong>Indicated for</strong> <br />Wounds containing bacteria, yeast and fungus <br /><br /><strong></strong><strong>Action</strong> <br />Provides a protective, bacteriostatic cover which may help prevent infection <br /><br />When used under an <a href=\"http://www.admedonline.com/education.asp#occlusive\">occlusive</a> dressing, product will create a mild <a href=\"http://www.admedonline.com/education.asp#negative\">negative pressure</a> that will reduce an <a href=\"http://www.admedonline.com/education.asp#epiboly\">epiboly</a> (rolled edge). <br /><br /><strong>Contraindications</strong> <br />None known </p>\r\n<hr />\r\n<p><br /><strong><a name=\"hydrogel\"></a><a href=\"http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare\">HYDROGEL DRESSINGS</a></strong><br /><strong>Must be covered with a secondary cover dressing</strong> <br /><br />Vary in composition but most are <a href=\"http://www.admedonline.com/education.asp#nonocclusive\">non-occlusive</a> and water or glycerin based, depending on manufacturer.  This product comes in sheets, impregnated in gauze and in gel form.</p>\r\n<p><strong>Examples: <br />hydrogel sheets – Spand-Gel, Avogel <br />amorphous hydrogel – Normlgel </strong><br /><br /><strong>Indicated for</strong> <br />Any type of wound needing additional moisture <br />Burns <br />Grafts <br />Sheet form can be used for quicker healing of cosmetic procedures and/or scar reduction <br /><br /><strong>Action</strong> <br />Adds moisture to dry wounds <br />Maintains a moist wound environment <br />Facilitates <a href=\"http://www.admedonline.com/education.asp#autolytic\"><span style=\"text-decoration: underline;\">autolytic debridement</span></a>. <br />Avogel sheets provide a barrier to prevent heat and water loss through the skin which aids in scar reduction <br /><br /><strong>Contraindications</strong> <br />Because of the moist nature of these dressings, care must be taken to observe the wound edges and protect from <a href=\"http://www.admedonline.com/education.asp#maceration\"><span style=\"text-decoration: underline;\">maceration</span></a>. </p>\r\n<hr />\r\n<p><br /><strong><a name=\"hydrogelanti\"></a><a href=\"http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare\">HYDROGEL</a> - <a href=\"http://www.admedonline.com/education.asp#antimicrobial\">ANTIMICROBIAL</a></strong><br /><br /><a href=\"http://www.admedonline.com/education.asp#amorphous\"><span style=\"text-decoration: underline;\">Amorphous</span></a> hydrogel combined with <a href=\"http://www.admedonline.com/education.asp#sodium\"><span style=\"text-decoration: underline;\">sodium hypochlorite</span></a> for elimination of bacteria, multi-resistant bacteria, viruses and fungi.</p>\r\n<p><strong>Example: <br />Anasept</strong><br /><br /><strong>Indicated for</strong> <br />Any wound needing additional moisture and infection protection <br />Dry wounds with signs of infection <br />Burns <br />Grafts <br /><br /><strong>Action</strong> <br />Provides moisture to a wound site while eliminating or preventing infection <a href=\"http://www.admedonline.com/education.asp#biocompatible\"><span style=\"text-decoration: underline;\">Biocompatible</span></a> with other dressings <br /><br /><strong>Contraindications</strong> <br />None known </p>\r\n<hr />\r\n<p><br /><strong><a name=\"hydrogelsilver\"></a><a href=\"http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare\">HYDROGEL WITH SILVER</a></strong><br /><br />Hydrogel with silver added for <a href=\"http://www.admedonline.com/education.asp#antimicrobial\"><span style=\"text-decoration: underline;\">antimicrobial</span></a> benefits</p>\r\n<p><strong>Examples: <br />SilverSept <br />Elta silver hydrogel </strong><br /><br /><strong>Indicated for</strong> <br />Wounds needing additional moisture and infection protection <br />Dry wounds with evidence of infection <br /><br /><strong>Action</strong> <br />Provides moisture in a wound site while eliminating or preventing infection <br />Absorbs a small amount of wound <a href=\"http://www.admedonline.com/education.asp#exudate\"><span style=\"text-decoration: underline;\">exudate</span></a> <br /><br /><strong>Contraindications:</strong> <br />Should not be utilized in conjuction with Tegaderm Matrix as deactivation of both dressings will result </p>\r\n<hr />\r\n<p><br /><strong><a name=\"tape\"></a>HYPERTONIC DRESSINGS</strong><br /><br />Available in impregnated gauze and gel form, these dressings provide a high sodium chloride level to eliminate <a href=\"http://www.admedonline.com/education.asp#necrotic\">necrotic</a> tissue.</p>\r\n<p><strong>Examples: <br />Hypergel – gel used to break down eschar of <a href=\"http://www.admedonline.com/education.asp#necrotic\"><span style=\"text-decoration: underline;\">necrotic</span></a> tissue <br />Mesalt– dry sheet or strip (used to wick infection out of tunneling areas) <br />Curasalt <span class=\"tablehd\">– </span>moist hypertonic tape</strong><br /><br /><strong>Indicated for</strong> <br /><a href=\"http://www.admedonline.com/education.asp#autolytic\"><span style=\"text-decoration: underline;\">autolytic debridement</span></a> of <a href=\"http://www.admedonline.com/education.asp#necrotic\"><span style=\"text-decoration: underline;\">necrotic</span></a> tissue fills wound space to wick drainage out of a tunnel or <a href=\"http://www.admedonline.com/education.asp#undermining\"><span style=\"text-decoration: underline;\">undermining</span></a> provides or encourages a moist environment <br /><br /><strong>Action</strong> <br />creates <a href=\"http://www.admedonline.com/education.asp#osmotic\"><span style=\"text-decoration: underline;\">osmotic</span></a> changes in the wound environment to encourage debridement <br /><br /><strong></strong><strong>Contraindications:</strong> <br />cannot apply to <a href=\"http://www.admedonline.com/education.asp#granulation\"><span style=\"text-decoration: underline;\">granulation</span></a> tissue as it can cause a burning sensation </p>\r\n<hr />\r\n<p><br /><strong><a name=\"foam\"></a><a href=\"http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare\">FOAM DRESSINGS, BORDERED FOAM DRESSINGS, FOAM DRESSINGS WITH SILVER</a></strong><br /><strong>May be used as a primary or secondary dressing</strong><br /><br />Available as self-adhering or non-adherent (though some may have adhesive border). Polyurethane foam dressings which have an absorbent wound contact surface and most have a moisture-repellant outer surface which is <a href=\"http://www.admedonline.com/education.asp#nonocclusive\"><span style=\"text-decoration: underline;\">non-occlusive</span></a>.  Ability to absorb<a href=\"http://www.admedonline.com/education.asp#exudate\"><span style=\"text-decoration: underline;\">exudate</span></a> is dependant upon thickness and density of the dressing.</p>\r\n<p><strong>Examples: <br />Mepilex (with Safetac technology) <br />Mepilex Border (water resistant with Safetac technology) <br />Polymem <br />Polymem Dot (with silver) <br />Reliamed</strong><br /><br /><strong>Indicated for</strong> <br />Partial and <a href=\"http://www.admedonline.com/education.asp#full_thkns\">full thickness</a> wounds <br />To cover wounds containing packing material <br /><br /><strong></strong><strong>Action</strong> <br />Absorbs excess <a href=\"http://www.admedonline.com/education.asp#exudate\"><span style=\"text-decoration: underline;\">exudate</span></a> to prevent <a href=\"http://www.admedonline.com/education.asp#maceration\"><span style=\"text-decoration: underline;\">maceration</span></a> <br />Provides a moist wound environment <br />Insulation and protection <br /><br /><strong></strong><strong>Contraindications</strong> <br />Wounds with dry eschar <br />No or minimal <a href=\"http://www.admedonline.com/education.asp#exudate\"><span style=\"text-decoration: underline;\">exudate</span></a></p>\r\n<hr />\r\n<p><br /><strong><a name=\"moisture\"></a>MOISTURE REGULATION</strong><br /><strong>Requires a secondary dressing to cover it</strong> <br /><br />An inert breathable polymer combined with a nonwoven medium which provides fluid balance at the wound surface instead of within the dressing.</p>\r\n<p><strong>Example: <br />TheraGauze </strong><br /><br /><strong>Indicated for:</strong> <br /><a href=\"http://www.admedonline.com/education.asp#partial_thkns\"><span style=\"text-decoration: underline;\">partial</span></a> and <a href=\"http://www.admedonline.com/education.asp#full_thkns\"><span style=\"text-decoration: underline;\">full thickness</span></a> wounds of any type <br />grafts <br />burns <br /><br /><strong>Action:</strong> <br />Controls moisture and facilitates healing by releasing or absorbing moisture based on wound conditions <br />Prevents <a href=\"http://www.admedonline.com/education.asp#maceration\"><span style=\"text-decoration: underline;\">maceration</span></a> <br />High oxygen <a href=\"http://www.admedonline.com/education.asp#permeability\"><span style=\"text-decoration: underline;\">permeability</span></a> <br />Compatible with most other medications <br />One-piece removal <br /><br /><strong>Contraindications:</strong> <br />Wet wounds unless <a href=\"http://www.admedonline.com/education.asp#fenestrated\"><span style=\"text-decoration: underline;\">fenestrated</span></a></p>\r\n<hr />\r\n<p><br /><strong><a name=\"mmpred\"></a><a href=\"http://www.admedonline.com/education.asp#mmps\">MMP</a> REDUCTION</strong><br /><strong>Requires a secondary dressing to cover it</strong> <br /><br />Cellulose impregnated with potassium, zinc, calcium and rubidium. </p>\r\n<p><strong>Examples <br />Tegaderm Matrix <br />EpiMax</strong><br /><br /><strong>Indicated for</strong> <br />All types of wounds including burns, grafts and incisions <br />“Kick-starting” stalled wounds <br /><br /><strong>Action</strong> <br />Corrects the MMP balance in the wound site enabling the patient’s <a href=\"http://www.admedonline.com/education.asp#growth\"><span style=\"text-decoration: underline;\">growth factors</span></a> to heal the wound <br />Creates a moist wound environment while preventing <a href=\"http://www.admedonline.com/education.asp#maceration\"><span style=\"text-decoration: underline;\">maceration</span></a> <br /><br /><strong>Contraindications</strong> <br />Use with silver products will cause deactivation of both products. </p>\r\n<hr />\r\n<p><br /><strong><a name=\"transparent\"></a><a href=\"http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare\">TRANSPARENT FILM DRESSINGS</a></strong><br /><br />Semipermeable membranes which are self-adhering, thin and waterproof. They allow gaseous exchange between the wound bed and the environment, but water, bacteria or other contaminants cannot penetrate the dressing</p>\r\n<p><strong>Examples: <br />Mepore <br />ReliaMed Transparent Thin film dressings</strong><br /><br /><strong>Indicated for:</strong> <br /><a href=\"http://www.admedonline.com/education.asp#partial_thkns\"><span style=\"text-decoration: underline;\">partial thickness</span></a> wounds <br />stage II ulcers <br />dry, <a href=\"http://www.admedonline.com/education.asp#necrotic\"><span style=\"text-decoration: underline;\">necrotic</span></a> wounds requiring debridement <br /><br /><strong>Action</strong> <br />helps to maintain a moist wound surface <br />facilitates <a href=\"http://www.admedonline.com/education.asp#autolytic\"><span style=\"text-decoration: underline;\">autolytic debridement</span></a>.  <br /><br /><strong>Contraindications for use:</strong> <br />heavy <a href=\"http://www.admedonline.com/education.asp#exudate\"><span style=\"text-decoration: underline;\">exudating</span> </a>wounds <br />deep cavities, sinus tracts or <a href=\"http://www.admedonline.com/education.asp#undermining\"><span style=\"text-decoration: underline;\">undermining</span></a> (unless used as a secondary dressing) or wounds with <a href=\"http://www.admedonline.com/education.asp#friable\"><span style=\"text-decoration: underline;\">friable</span></a> skin in the <a href=\"http://www.admedonline.com/education.asp#periwound\"><span style=\"text-decoration: underline;\">periwound</span></a> area.</p>','product-terminology'),
