('3','2','0','Hi am Louise from Guam and would like to know if you sell to wholesalers and distributors.  Please advice.',NULL,'2033702204','Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/27.0.1453.110 Safari/537.36','2013-06-10 00:02:25','0','1'),
('5','4','0','Hello\r\nI am a wound care nurse and I meet one of your reps at the Wild on Wounds conference last year in Las Vegas. If possible can you send me a sample of the multi-layer compression stocking in a size c short. I referred a couple of my patients to your company but the samples I.currently have in the clinic ',NULL,'1144082769','Mozilla/5.0 (Macintosh; U; Intel Mac OS X 10_6_3; en-us; Silk/1.0.22.153_10033210) AppleWebKit/533.16 (KHTML, like Gecko) Versio','2013-06-11 21:31:40','0','1'),
('6','5','0','greetings.  the photo used for the Sorbact + Alginate Dressing System is Copyright protected.  Please remove promptly.',NULL,'1264380423','Mozilla/5.0 (Macintosh; Intel Mac OS X 10_7_5) AppleWebKit/536.29.13 (KHTML, like Gecko) Version/6.0.4 Safari/536.29.13','2013-06-11 22:50:32','0','1'),
('7','2','2','Dear Louise,\r\nWe do sell to wholesalers and distributors at volume discounts.  The prices on this site are for individual purchases.  Please email me at sbishop@woundcareresources.net  to let me know what products you would like to purchase, and I can give you some pricing. We set up our volume purchasers through another website where companies can place orders online (or by phone). \r\n\r\nThanks for your inquiry.\r\n\r\n\r\nRegards,\r\nSheri Bishop\r\nCEO\r\nAdvanced Medical Resources.\r\n',NULL,'1257100608',NULL,'2013-06-13 09:58:03','0','1'),
('8','4','2','Dear Customer,\r\nPlease contact me at sbishop@woundcareresources.net.  I did not receive your entire email.\r\n\r\nRegards,\r\nSheri Bishop',NULL,'1257100608',NULL,'2013-06-13 09:59:57','0','1'),
('10','7','0','I am looking for a DME provider to provide Sorbion Sachets but need a company that is contracted with any Blue Cross Blue Shield in the US.  ARe you contracted? If not can you tell me of any other companies that sell Sorbion?  I have a GERMAN and a UK site but must use US company',NULL,'207673606','Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.1; WOW64; Trident/4.0; CWADS32; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .','2013-06-28 17:14:37','0','1'),
('13','10','0','The tracking number I was given is wrong -- showed an L rather than a 1\r\n\r\nWhat worries me more is I replied to the email I got from you&#039;d company and it sent an email to someone t DesignHaus42 -- \r\n\r\nDon&#039;t you have to comply with HIPAA?\r\n\r\nThey should set your notices uo so when a customer writes YOU --- they get your firm and not a graphics house.',NULL,'2147483647','Mozilla/5.0 (iPad; CPU OS 6_1_3 like Mac OS X) AppleWebKit/536.26 (KHTML, like Gecko) Version/6.0 Mobile/10B329 Safari/8536.25','2013-08-15 19:41:17','0','1'),
('14','11','0','Please verify that this order is for two 3 oz tubes. Thank you. ',NULL,'0',NULL,'2013-08-21 17:31:06','0','1'),
('15','12','0','Just curious when I would receive my order? No real details on website in need of the oil dressing and very expensive near home. Please update my asap, thanks. \r\n\r\nTania Holman',NULL,'404272984','Mozilla/5.0 (compatible; MSIE 10.0; Windows NT 6.1; WOW64; Trident/6.0)','2013-09-03 23:06:44','0','1'),
('16','10','0',' Louise Bertao\n08/15/2013 19:41:17	The tracking number I was given is wrong -- showed an L rather than a 1\n\nWhat worries me more is I replied to the email I got from you&#039;d company and it sent an email to someone t DesignHaus42 --\n\nDon&#039;t you have to comply with HIPAA?\n\nThey should set your notices uo so when a customer writes YOU --- they get your firm and not a graphics house.\n\nReply please ',NULL,'2147483647',NULL,'2013-09-23 05:10:53','0','1'),
('17','13','0','please be sure to send me correct tracking number this order --Thanks ',NULL,'0',NULL,'2013-09-23 05:29:21','0','1'),
('18','14','0','Hi,\r\n\r\nCan you please let me know who I can talk to about selling our range of wound care products on your website?\r\n\r\nAlso your address contact@admedonline.com, is not working! ',NULL,'1445688852','Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/30.0.1599.69 Safari/537.36','2013-10-16 09:25:11','0','1'),
('19','15','0','We can increase rankings of your website in search engines. Please reply back for more details.',NULL,'2057408607','Mozilla/5.0 (Windows; U; Windows NT 5.1; en-US; rv:1.9.2.19) Gecko/20110707 Firefox/3.6.19 GTB7.1 ( .NET CLR 3.5.30729)','2013-10-28 05:34:59','0','1'),
('20','10','2','Dear Ms. Bertao,\r\nI have to apologize that you have not been receiving proper communication to the comments and questions you have have sent to our customer service department.  \r\n\r\nOur website is fairly new and as time goes on, we are figuring out glitches that need to be corrected.  One such glitch is that your questions/comments were going to the gentleman that built our website and ending up in his spam file. I have now corrected this, and your questions/comments should go to the correct person. If you ever want to speak to our retail department, please call toll free (866) 755-2677 and ask for Jackie.  She will take good care of you.\r\n\r\nWe very much appreciate your business.\r\n\r\nRegards,\r\nSheri Bishop\r\nCEO\r\nAdvanced Medical Resources\r\nwww.admedonline.com',NULL,'1257100608',NULL,'2013-11-04 12:15:21','0','1'),
('21','10','2','Message forwarded to jackie scott\nComment: You can add a comment here.',NULL,'1257100608',NULL,'2013-11-04 12:15:56','1','1'),
('22','12','2','Dear Customer,\r\nI apologize that your message on 9/3/2013 was never answered.  We are just finding some glitches in this fairly-new website and discovered that customer comments have not been received by our sales department. \r\n\r\nWe ship out orders so they are received in two days to most locations. \r\n\r\nI am hoping your wound has resolved, but let me know if I can answer any questions regarding the oil dressings or any other.  \r\nin which you are interested.\r\n\r\nWe appreciate your business and are sorry you did not get the information you were looking for regarding the oil dressing..  \r\n\r\n\r\nRegards,\r\nSheri Bishop\r\nCEO\r\nAdvanced Medical Resources\r\nsbishop246@woundcareresources.net',NULL,'1257100608',NULL,'2013-11-04 12:24:07','0','1'),
('23','16','0','Hello,\r\n\r\nI am following up on an email I sent to contact@admedonline.com on Sept 2nd and also 16th Oct regarding the possible distribution of our products in the US.\r\n\r\nCan you please redirect my query to the correct person?\r\n\r\nShirley Kiernan',NULL,'1445688852','Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/30.0.1599.101 Safari/537.36','2013-11-07 07:10:36','0','1'),
('24','16','2','Shirley,\r\nPlease send some information regarding your products to my email address:\r\nsbishop@woundcareresources.net.\r\n\r\nRegards,\r\nSheri Bishop\r\nCEO',NULL,'1257100608',NULL,'2013-11-12 13:33:47','0','1'),
