('30','22','0','Hello. My name is Bethany Daly. I work with lymphedema patients and I recently found information about your product, Spandage. I commonly have patients that come to our practice with  a lymphedema diagnosis of the lower extremities. The compression wraps used to decrease the leg swelling tend to slide down the leg  throughout the day and the patients have to rewrap the leg or the patients tend to just remove the bandages and do no reapply them. It can be frustrating for the patient and for the therapist as the use of the compression wraps is a major portion of the treatment protocol.  I was wondering if you could send some samples of your product for our patients to try? It would be a great  to have an option for patients to have a product to try with this problem.\r\n\r\nRegards,\r\nBethany Daly, PTA\r\n',NULL,'1823656942','Mozilla/5.0 (Windows NT 6.1; Trident/7.0; rv:11.0) like Gecko','2014-02-07 09:59:46','0','1'),
