INSERT INTO `ps_product_comment` VALUES
('1','132','90','0','Algidex Paste removal','My chronic wound has now had ten dressings using Algidex Paste (approx. at 3 day intervals) and although there is some healing, on the last occasion my nurse said that she found it difficult to remove the previous application of the paste, and the wound may need surgical debridement.\r\n\r\nMy hospital doctors (two surgical interventions) are completely unforthcoming, they do not seem to know even about the simple instructions given with the paste.\r\n\r\nAny advice would be appreciated, or can you recommend a different product?','Isaline Alleyne-Cope','3','0','0','2014-01-06 11:43:39');
