INSERT INTO `ps_product_lang` VALUES
('8','1','1','<p>Dupad abdominal pads are filled with cellulose fibers making them super-absorbent. The fibers quickly absorb and disperse fluids laterally to prevent pooling and maceration. The backing is constructed of a hydrophobic material which prevents strike-through. All edges are sealed to prevent linting. Latex Free.</p>','<p>Dupad abdominal pads are filled with cellulose fibers making them super-absorbent. The fibers quickly absorb and disperse fluids laterally to prevent pooling and maceration.</p>','dupad-abdominal-pad','absorbent dressings for draining wounds',NULL,'ABD pad','ABD Pad- Abdominal Pad',NULL,NULL),
('8','1','2','<p>Dupad abdominal pads are filled with cellulose fibers making them super-absorbent. The fibers quickly absorb and disperse fluids laterally to prevent pooling and maceration. The backing is constructed of a hydrophobic material which prevents strike-through. All edges are sealed to prevent linting. Latex Free.</p>','<p>Dupad abdominal pads are filled with cellulose fibers making them super-absorbent. The fibers quickly absorb and disperse fluids laterally to prevent pooling and maceration.</p>','dupad-abdominal-pad',NULL,NULL,'Dupad Abdominal Pad','Dupad Abdominal Pad',NULL,NULL),
