('8','1','6','<p>Dupad abdominal pads are filled with cellulose fibers making them super-absorbent. The fibers quickly absorb and disperse fluids laterally to prevent pooling and maceration. The backing is constructed of a hydrophobic material which prevents strike-through. All edges are sealed to prevent linting. Latex Free.</p>','<p>Dupad abdominal pads are filled with cellulose fibers making them super-absorbent. The fibers quickly absorb and disperse fluids laterally to prevent pooling and maceration.</p>','dupad-abdominal-pad',NULL,NULL,'Dupad Abdominal Pad','Dupad Abdominal Pad',NULL,NULL),
('9','1','1','<p>A multi-layered, highly absorbent wound dressing. Gentle non-woven rayon pad between two non-adhering polypropylene contact layers. Will not stick to wound site, damage fragile granulation tissue or traumatize wound upon removal. Absorbs significantly more drainage than similar dressings resulting in fewer dressing changes. Use in place of gauze and tape when more absorbency is needed.</p>\r\n<p>Use as a primary or secondary dressing.</p>','<p>A multi-layered and highly absorbent wound dressing. Will not stick to wound site, damage fragile granulation tissue or traumatize wound upon removal.</p>','multipad-non-adherent-wound-dressing',NULL,NULL,'Multipad Non-Adherent Wound Dressing','Multipad Non-Adherent Wound Dressing',NULL,NULL),
('9','1','2','<p>A multi-layered and highly absorbent wound dressing. Gentle and non-woven rayon pad between two non-adhering polypropylene contact layers. Will not stick to wound site or damage fragile granulation tissue or traumatize wound upon removal. Non-linting - Absorbs significantly more drainage than similar dressings resulting in fewer dressing changes. Use in place of gauze and tape when more absorbency is needed. This can be a primary or secondary dressing.</p>','<p>A multi-layered and highly absorbent wound dressing. Gentle and non-woven rayon pad between two non-adhering polypropylene contact layers. Will not stick to wound site or damage fragile granulation tissue or traumatize wound upon removal.</p>','multipad-non-adherent-wound-dressing',NULL,NULL,'Multipad Non-Adherent Wound Dressing','Multipad Non-Adherent Wound Dressing',NULL,NULL),
('9','1','3','<p>A multi-layered and highly absorbent wound dressing. Gentle and non-woven rayon pad between two non-adhering polypropylene contact layers. Will not stick to wound site or damage fragile granulation tissue or traumatize wound upon removal. Non-linting - Absorbs significantly more drainage than similar dressings resulting in fewer dressing changes. Use in place of gauze and tape when more absorbency is needed. This can be a primary or secondary dressing.</p>','<p>A multi-layered and highly absorbent wound dressing. Gentle and non-woven rayon pad between two non-adhering polypropylene contact layers. Will not stick to wound site or damage fragile granulation tissue or traumatize wound upon removal.</p>','multipad-non-adherent-wound-dressing',NULL,NULL,'Multipad Non-Adherent Wound Dressing','Multipad Non-Adherent Wound Dressing',NULL,NULL),
('9','1','4','<p>A multi-layered and highly absorbent wound dressing. Gentle and non-woven rayon pad between two non-adhering polypropylene contact layers. Will not stick to wound site or damage fragile granulation tissue or traumatize wound upon removal. Non-linting - Absorbs significantly more drainage than similar dressings resulting in fewer dressing changes. Use in place of gauze and tape when more absorbency is needed. This can be a primary or secondary dressing.</p>','<p>A multi-layered and highly absorbent wound dressing. Gentle and non-woven rayon pad between two non-adhering polypropylene contact layers. Will not stick to wound site or damage fragile granulation tissue or traumatize wound upon removal.</p>','multipad-non-adherent-wound-dressing',NULL,NULL,'Multipad Non-Adherent Wound Dressing','Multipad Non-Adherent Wound Dressing',NULL,NULL),
('9','1','5','<p>A multi-layered and highly absorbent wound dressing. Gentle and non-woven rayon pad between two non-adhering polypropylene contact layers. Will not stick to wound site or damage fragile granulation tissue or traumatize wound upon removal. Non-linting - Absorbs significantly more drainage than similar dressings resulting in fewer dressing changes. Use in place of gauze and tape when more absorbency is needed. This can be a primary or secondary dressing.</p>','<p>A multi-layered and highly absorbent wound dressing. Gentle and non-woven rayon pad between two non-adhering polypropylene contact layers. Will not stick to wound site or damage fragile granulation tissue or traumatize wound upon removal.</p>','multipad-non-adherent-wound-dressing',NULL,NULL,'Multipad Non-Adherent Wound Dressing','Multipad Non-Adherent Wound Dressing',NULL,NULL),
('9','1','6','<p>A multi-layered and highly absorbent wound dressing. Gentle and non-woven rayon pad between two non-adhering polypropylene contact layers. Will not stick to wound site or damage fragile granulation tissue or traumatize wound upon removal. Non-linting - Absorbs significantly more drainage than similar dressings resulting in fewer dressing changes. Use in place of gauze and tape when more absorbency is needed. This can be a primary or secondary dressing.</p>','<p>A multi-layered and highly absorbent wound dressing. Gentle and non-woven rayon pad between two non-adhering polypropylene contact layers. Will not stick to wound site or damage fragile granulation tissue or traumatize wound upon removal.</p>','multipad-non-adherent-wound-dressing',NULL,NULL,'Multipad Non-Adherent Wound Dressing','Multipad Non-Adherent Wound Dressing',NULL,NULL),
('10','1','1','<p>A highly absorbent, multi-layered one-piece dressing. Five layer construction  permits passage of wound drainage to keep periwound skin dry and prevent maceration at the wound site.  Drainage is wicked horizontally along the pad to icrease dressing absorption capacity. Conforms to hard-to-dress areas without unnecessary bulk. Ideal for protecting wound sites from further trauma. Soft pliability allows for range of motion exercises during recovery.</p>','<p>A highly absorbent, multi-layered one-piece dressing. Five layer construction  permits passage of wound drainage to keep periwound skin dry and prevent maceration at wound site.</p>','sofsorb-absorbent-wound-dressing','Super absorbent ABD pad','5-layer,super absorbent dressing','Sofsorb Absorbent Wound Dressing','Sofsorb Absorbent Wound Dressing',NULL,NULL),
('10','1','2','<p>A highly absorbent and multi-layered one-piece dressing. Five layer construction: May be soaked with saline or topical agents prior to use. Rounded edges and tapered limb configurations conform to curved and hard-to-dress areas without unnecessary bulk. Ideal for protecting wound sites from further trauma. Soft pliability allows for range of motion exercises during recovery.</p>','<p>A highly absorbent and multi-layered one-piece dressing. Five layer construction: May be soaked with saline or topical agents prior to use.</p>','sofsorb-absorbent-wound-dressing',NULL,NULL,'Sofsorb Absorbent Wound Dressing','Sofsorb Absorbent Wound Dressing',NULL,NULL),
('10','1','3','<p>A highly absorbent and multi-layered one-piece dressing. Five layer construction: May be soaked with saline or topical agents prior to use. Rounded edges and tapered limb configurations conform to curved and hard-to-dress areas without unnecessary bulk. Ideal for protecting wound sites from further trauma. Soft pliability allows for range of motion exercises during recovery.</p>','<p>A highly absorbent and multi-layered one-piece dressing. Five layer construction: May be soaked with saline or topical agents prior to use.</p>','sofsorb-absorbent-wound-dressing',NULL,NULL,'Sofsorb Absorbent Wound Dressing','Sofsorb Absorbent Wound Dressing',NULL,NULL),
('10','1','4','<p>A highly absorbent and multi-layered one-piece dressing. Five layer construction: May be soaked with saline or topical agents prior to use. Rounded edges and tapered limb configurations conform to curved and hard-to-dress areas without unnecessary bulk. Ideal for protecting wound sites from further trauma. Soft pliability allows for range of motion exercises during recovery.</p>','<p>A highly absorbent and multi-layered one-piece dressing. Five layer construction: May be soaked with saline or topical agents prior to use.</p>','sofsorb-absorbent-wound-dressing',NULL,NULL,'Sofsorb Absorbent Wound Dressing','Sofsorb Absorbent Wound Dressing',NULL,NULL),
('10','1','5','<p>A highly absorbent and multi-layered one-piece dressing. Five layer construction: May be soaked with saline or topical agents prior to use. Rounded edges and tapered limb configurations conform to curved and hard-to-dress areas without unnecessary bulk. Ideal for protecting wound sites from further trauma. Soft pliability allows for range of motion exercises during recovery.</p>','<p>A highly absorbent and multi-layered one-piece dressing. Five layer construction: May be soaked with saline or topical agents prior to use.</p>','sofsorb-absorbent-wound-dressing',NULL,NULL,'Sofsorb Absorbent Wound Dressing','Sofsorb Absorbent Wound Dressing',NULL,NULL),
('10','1','6','<p>A highly absorbent and multi-layered one-piece dressing. Five layer construction: May be soaked with saline or topical agents prior to use. Rounded edges and tapered limb configurations conform to curved and hard-to-dress areas without unnecessary bulk. Ideal for protecting wound sites from further trauma. Soft pliability allows for range of motion exercises during recovery.</p>','<p>A highly absorbent and multi-layered one-piece dressing. Five layer construction: May be soaked with saline or topical agents prior to use.</p>','sofsorb-absorbent-wound-dressing',NULL,NULL,'Sofsorb Absorbent Wound Dressing','Sofsorb Absorbent Wound Dressing',NULL,NULL),
('11','1','1','<p>The unique Hydration Response Technology of Sorbion Sachet S combines physically modified cellulose fibers with gel-forming components. The close interaction of both features in Sorbion Sachet S guarantees effective preparation for the wound bed and regulation of the wound conditions. This is what makes Sorbion Sachet S so effective at accelerating healing. Sorbion Sachet S is particularly suitable as a primary dressing for moderately to heavily exudating wounds and is especially useful in combination with the Carolon Multi-layer Stocking System and other compression modalities for management of exudate caused by venous insufficiency. The strong osmotic effect of Sorbion Sachet S guarantees rapid absorption of wound exudate with tremendous absorption capacity without drying out the wound. Microorganisms and cell debris are flushed from the depths of the wound and captured in Sorbion Sachet S. Sorbion Sachet S is very effective for moderately to heavily exudating wounds.</p>\r\n<p><span style=\"font-size: 12px; line-height: 1.5em;\">A secondary dressing is required to hold this dressing in place.</span></p>','<p>Very effective for moderate to very heavily draining wounds.</p>','sorbion-sachet-s',NULL,NULL,'Sorbion Sachet S','Sorbion Sachet S ',NULL,NULL),
