('12','1','1','<p>XTRASORB is a novel super-absorbent wound dressing. At its core is a super-absorbent polymer that allows the dressing to help re-define the category of highly absorbent. Many other absorbent dressings rely on spaces within the dressings to fill with fluid: XTRASORB\'s super-absorbent polymer binds to fluid and converts to a gel.</p>\r\n<p>Distinct advantages XTRASORB offers over traditional dressings: XTRASORB dressings are able to hold AND LOCK more fluid inside the dressing, helping to decrease the risk of maceration. The dressings come in a variety of sizes and can be used on an assortment of chronic and acute wounds including Pressure Ulcers, Diabetic Foot Ulcers, Fistulas,Venous Leg Ulcers, Post-Operative Wounds, Oncologic Wounds, Arterial Ulcers, Laparotomy Wounds</p>\r\n<p>May be used as a primary or secondary dressing.</p>','<p>XTRASORB is a novel super-absorbent wound dressing for very heavily draining wounds. At its core is a super-absorbent polymer that allows the dressing to help re-define the category of highly absorbent.</p>','xtrasorb-classic','Super absorbent for heavily-draining wounds',NULL,'XTRASORB ABD Pad','XTRASORB Classic',NULL,NULL),
('12','1','2','<p>XTRASORB is a novel super-absorbent wound dressing. At its core is a super-absorbent polymer that allows the dressing to help re-define the category of highly absorbent. Many other absorbent dressings rely on spaces within the dressings to fill with fluid but XTRASORB\'s super-absorbent polymer binds to fluid and converts to a gel. The distinct advantages this offers over traditional dressings are: XTRASORB dressings are able to hold more fluid and lock fluid inside the dressing which helps to decrease the risk of maceration. The dressings come in a variety of sizes and can be used on an assortment of chronic and acute wounds including: :: Pressure Ulcers Diabetic Foot Ulcers Fistulas :: Venous Leg Ulcers Post-Operative Wounds Oncologic Wounds :: Arterial Ulcers Laparotomy Wounds</p>','<p>XTRASORB is a novel super-absorbent wound dressing. At its core is a super-absorbent polymer that allows the dressing to help re-define the category of highly absorbent.</p>','xtrasorb-abd-pad',NULL,NULL,'XTRASORB ABD Pad','XTRASORB ABD Pad',NULL,NULL),
