('13','1','1','<p>Algicell Ag is a high-gelling alginate with superior absorption capacity reducing the risk of maceration. Algicell Ag is removable in one piece, leaves no residue in the open wound amd provides superior bactericidal action that goes to work almost immediately</p>\r\n<p>Algicell Ag provides an effective barrier to bacterial penetration <span style=\"font-size: 12px; line-height: 1.5em;\">and protects wound dressings against bacterial colonization. Reduces the risk of infection in moderately to heavily exuding wounds including diabetic foot ulcers, leg ulcers, pressure ulcers, donor sites and traumatic or surgical wounds.</span></p>\r\n<p><strong><span style=\"font-size: 12px; line-height: 1.5em;\">Should be used only for wounds that have moderate to heavy drainage.</span></strong></p>\r\n<p><span style=\"font-size: 12px; line-height: 1.5em;\">Secondary dressings required to hold in place</span></p>','<p>Algicell Ag is a high-gelling alginate with superior absorption capacity reducing the risk of maceration. Algicell Ag is removable in one piece and leaves no residue in the open wound.</p>','algicell-ag',NULL,NULL,'ALGICELL Ag','ALGICELL Ag',NULL,NULL),
