('16','1','1','<p><span style=\"font-size: 12px; line-height: 1.5em;\">Controlled silver ion release provides a broad spectrum of antimicrobial protection for up to three days. Effective in controlling wound bleeding. Absorbency and wet strength are key performance indicators. Blend of calcium alginate and carboxymethyl cellulose (CMC) provides excellent gelling and wet strength for one-piece and non-traumatic removal. Highly absorbent fluid wicks vertically into the dressing which minimizes the possibility of periwound skin maceration and reduces odor primarily caused by bacteria. Can be used for postoperative wounds, trauma wounds,leg ulcers, pressure ulcers,diabetic ulcers,graft and donor sites. Contraindicated for use on third-degree burns, dry or lightly exuding wounds and forindividuals with a known sensitivity to silver and/or calcium alginate.</span></p>\r\n<p><span style=\"font-size: 12px; line-height: 1.5em;\"><strong>Should only be used for wounds that have moderate to high amounts of drainage.</strong></span></p>\r\n<p><span style=\"font-size: 12px; line-height: 1.5em;\">www.reliamedproducts.com</span></p>\r\n<p><span style=\"font-size: 12px; line-height: 1.5em;\">Requires a secondary dressing</span></p>','<p>Controlled silver ion release provides a broad spectrum of antimicrobial protection for up to three days. Effective in controlling wound bleeding. Excellent absorbency and wet strength. </p>\r\n<p><strong>Should only be used for wounds that have moderate to high amounts of drainage.</strong></p>','reliamed-ag-cmc',NULL,NULL,'ReliaMed AG-CMC','ReliaMed AG-CMC',NULL,NULL),
