('18','1','1','<p>MEDIHONEY dressings are a unique line of dressings containing Active Leptospermum Honey from New Zealand and Australia. They have been shown to possess unique qualities that make them ideal for the management of chronic and acute wounds and burns. MEDIHONEY dressings are able to work in the presence of wound fluid or blood or tissue and promotes an optimal healing environment. As wound exudate is absorbed, the alginate forms a gel enabling easy removal without disrupting the wound bed. Medihoney dressings are indicated for the management of moderate to heavily exuding wounds such as diabetic foot ulcers,venous stasis leg ulcers, arterial leg ulcers, ulcers of mixed etiology, pressure ulcers (I-IV), 1st and 2nd degree burns, donor sites,traumatic and surgical wounds</p>\r\n<p><strong>Should only be used for wounds with moderate to heavy drainage.</strong> www.dermasciences.com</p>\r\n<p>Secondary dressing required to hold in place.</p>','<p>MEDIHONEY dressings are a unique line of dressings containing Active Leptospermum Honey from New Zealand and Australia. They have been shown to possess unique qualities that make them ideal for the management of chronic and acute wounds and burns.</p>\r\n<p><strong>Should only be used for wounds with moderate to heavy drainage.</strong></p>','medihoney-alginate','Manuka honey dressing combining alginate for ddrainage absorption with the healing and debridement of natural honey to create an optimal healing environment.',NULL,'MEDIHONEY Alginate','MEDIHONEY Alginate',NULL,NULL),
