('26','1','1','<p>BEST PRICE and FREE SHIP!  </p>\r\n<p>Anasept® Antimicrobial Cleanser is an extremely safe and gentle wound cleanser that eliminates all bacteria, fungi and viruses including MRSA, VRE, C Difficile, Acinetobacter and more in 30-60 seconds without harm to healthy tissue.  It should be used when there is any break in the skin,  skin irritation or a chronic wound. It is also used for preparation for dialysis and central line, IV fluid and infusion sites. Anasept Antimircrobial Skin and Wound Cleanser is a colorless isotonic-tissue compatible solution.  Anasept  is stable for two-years and is free of necrotizing chemicals found in other antiseptic products. Anasept Spray will not stain the skin.</p>\r\n<p><strong>FDA approved as an antimicrobial solution.</strong>  </p>\r\n<p>Learn more about this product at <span style=\"text-decoration: underline;\">www.anacapa-tech.net</span></p>','<p>Anasept® Antimicrobial Cleanser is an extremely safe, gentle wound cleanser that eliminates all bacteria, fungus and viruses including MRSA and VRE and more in 30-60 seconds without harm to healthy tissue. Use to clean wounds of any kind.</p>','anasept-antimicrobial-skin-and-wound-cleanser','Anasept Antimicrobial Cleanser is an extremely safe and gentle wound cleanser that eliminates all bacteria, fungi and viruses including MRSA, VRE, C Difficile, Acinetobacter and more .',NULL,NULL,'Anasept Antimicrobial Skin and Wound Cleanser',NULL,NULL),
