('29','1','1','<p> FIBRACOL PLUS Dressing combines the structural support of collagen with the exudate management of alginate. FIBRACOL PLUS Dressing is made up of 90% collagen and 10% alginate. This combination provides the versatility you need when addressing a variety of wound types and a wide range of exudate levels (from low to high). FIBRACOL PLUS maintains a moist wound environment which is conducive to granulation tissue formation and epithelialization that enables healing to proceed optimally. Indicated for the management of exuding wounds including: Full-thickness and partial-thickness wounds, Pressure ulcers, Venous ulcers,  Ulcers caused by mixed vascular etiologies, Diabetic ulcers, Second-degree burns,  Donor sites and other bleeding surface wounds, Abrasions, Traumatic wounds, Dehisced surgical incisions</p>\r\n<p>Requires a secondary dressing to hold in place.</p>','<p>FIBRACOL PLUS Dressing combines the structural support of collagen with the exudate management of alginate. FIBRACOL PLUS provides the versatility you need when addressing a variety of wound types and exudate levels.</p>','fibracol-plus','Unique collagen that provides structure for healing wounds as well as alginate to control drainage and provide for correct moisture level needed for healing.',NULL,'Fibracol Plus','Fibracol Plus',NULL,NULL),
