('33','1','1','<p>Alldress composite dressing is an all-in-one self-adherent absorbent dressing ideal for a wide variety of low to moderately exuding wounds as either primary or secondary dressing. The Alldress backing film provides a moist wound environment and protects the wound from water and contamination. Benefits of Alldress: Alldress has an easy-to-remove protection paper for convenient and aseptic application. Alldress has a breathable film that provides a moist wound environment along with a viiral and bacteria-proof backing film for safety and protection. Alldress features a liquid-proof barrier for protection from strike-through of wound fluids and outside contamination and a low-adherent wound contact netting that minimizes disturbance to the wound. Alldress composite dressing has a skin-friendly polyacrylate adhesive for gentle and secure fixation. The Alldress highly absorbent wound pad provides excellent exudate management.</p>','<p>Alldress composite dressing is an all-in-one self-adherent absorbent dressing ideal for a wide variety of low to moderately exuding wounds as either primary or secondary dressing.  The Alldress backing film provides a moist wound environment and protects the wound from water and contamination.</p>','alldress-composite-dressing',NULL,NULL,'Alldress Composite Dressing','Alldress Composite Dressing',NULL,NULL),
