('36','1','1','<p>Coban 2 Layer is a unique compression system that is engineered with Intelligent Compression Dynamics to stay in place and deliver comfortable/effective and therapeutic compression for venous leg ulcers and other conditions requiring compression. 3M Coban 2 Layer Compression System is clinically proven to significantly reduce slippage and improve patients\' daily living activities and physical symptoms. Latex-free Coban 2 Layer System consists of an inner comfort layer and an outer compression layer that is fast and easy to apply. Because it is thin and lightweight Coban 2 Layer allows patients to wear normal footwear. The 3M Coban 2 Layer Compression System is latex-free and is ideal for the majority of patients with venous leg ulcers and lymphedema and other conditions where compression therapy is appropriate including those with an ABPI greater than or equal to 0.8.</p>\r\n<p>FOR PROFESSIONAL USE ONLY.</p>','<p>Coban 2 Layer is a unique compression system that is engineered with Intelligent Compression Dynamics to stay in place and deliver comfortable/effective and therapeutic compression for venous leg ulcers and other conditions requiring compression. FOR PROFESSIONAL USE ONLY.</p>','3m-coban-2-layer-compression-system',NULL,NULL,'3M Coban 2 Layer Compression System','3M Coban 2 Layer Compression System',NULL,NULL),
