('37','1','1','<p>3M Coban 2 Layer Lite is engineered with Intelligent Compression Dynamics to stay in place on the leg and deliver comfortable, effective and therapeutic compression for venous leg ulcers and other conditions. The Coban 2 Layer Lite Compression System is designed for patients whose physical condition makes them less tolerant of traditional compression therapy. 3M Coban 2 Layer Compression System is clinically proven to significantly reduce slippage and improve patients\' daily living activities and physical symptoms. The latex-free Coban 2 Layer System consists of an inner comfort layer and an outer compression layer that is fast and easy to apply. Because it is thin and lightweight it allows patients to wear normal footwear. 3M Coban 2 Layer Lite Compression System is specifically designed for patients less tolerant of compression therapy. This includies those who have mixed etiology with an APBI greater than or equal to 0.5. Also those who are new to compression where tolerance is not known or who are frail or less mobile. Coban 2 Layer Lite System provides the same effective compression as Coban 2 Layer Compression system with a 25% reduced resting pressure.</p>\r\n<p>FOR PROFESSIONAL USE ONLY.</p>','<p>3M Coban 2 Layer Lite is engineered for patients who are less tolerant of traditional compression therapy.  It is made to stay in place on the leg and deliver comfortable, effective and therapeutic compression.  FOR PROFESSIONAL USE ONLY.</p>','3m-coban-2-layer-lite-compression-system',NULL,NULL,'3M Coban 2 Layer Lite Compression System','3M Coban 2 Layer Lite Compression System',NULL,NULL),
