('38','1','1','<p><strong>FREE SHIPPING  and Best Price!</strong></p>\r\n<p><strong>Carolon MLS </strong>is a unique compression product for the treatment of venous insufficiency and to prevent or heal ulcers caused by this condition. The Carolon Multilayer Compression System is designed to fit over a wound care dressing if the patient has an open wound associated with venous insufficiency.</p>\r\n<p>Class II (30-40 mmHg) - Includes <strong>TWO</strong> underlayers and <strong>TWO</strong> stockings/socks per box.</p>\r\n<p>Class III (40-50 mmHg) - includes <strong>TWO</strong> underlayers and <strong>TWO</strong> stockings/socks per box.</p>\r\n<p>The Carolon Multilayer <span style=\"line-height: 1.5em;\">Multilayer Compression System provides therapeutic support, improved circulation and prevention of varicosities and chronic insufficiencies. Because the product is applied in two layers, it is easier to don than other compression stockings having therapeutic compression levels. T</span><span style=\"line-height: 1.5em;\">he Carolon Multilayer Compression System is also recommended for endovenous ablation and phlebectomy procedures.</span></p>\r\n<p>The Carolon Multilayer Compression System is available in knee length. :: Choice of colors: nude stocking or black dress sock :: Washable/dryable-safe in a mesh bag for delicates:: Latex-free</p>\r\n<p> </p>\r\n<p><strong>PLEASE USE THE SIZE CHART BELOW TO DETERMINE CORRECT SIZE</strong>: Stockings that do not fit correctly will not provide adequate therapeutic results.</p>\r\n<p style=\"text-align: left;\"><strong style=\"line-height: 1.5em;\">1) Use measuring tape to determine smallest ankle circumference and largest calf circumference.</strong></p>\r\n<p style=\"text-align: left;\"><strong>2) Determine correct  length by measuring from heel to bend in knee.</strong></p>\r\n<table style=\"border: 1px solid #666666 !important; float: left;\" border=\"1\" cellspacing=\"20\">\r\n<tbody>\r\n<tr>\r\n<td style=\"border: 1px