('48','1','1','<p>PolyMem Ag can be used instead of other dressings containing silver because the dressings support moist wound healing while providing a continuous silver reservoir. PolyMem Ag Benefits: Polymem Ag incorporates unique silver particles. Eliminates need for secondary dressing (except when using PolyMem WIC Silver). Absorbs up to 10 times its dressing weight in exudate. Maintains a moist wound environment for improved healing. Indicates when dressing change is necessary via its clear and thin backing (except PolyMem WIC Silver). </p>','<p>PolyMem Ag foam dressings can be used instead of other dressings containing silver because the dressings support moist wound healing while providing a continuous silver reservoir. Absorbs up to ten times its weight in exudate.</p>','polymem-ag-non-adhesive',NULL,NULL,'PolyMem Ag Non-Adhesive','PolyMem Ag Non-Adhesive',NULL,NULL),
