('49','1','1','<ul>\r\n<li><span style=\"font-size: 12px; line-height: 1.5em;\">With four aspects of wound care in one formulation, PolyMem can be used throughout the wound-healing continuum. </span></li>\r\n<li>PolyMem is also indicated for all wound types (e.g., full and partial thickness wounds, skin tears, ulcers, surgical wounds, first- and second-degree burns).</li>\r\n<li>PolyMem\'s dressings are highly absorbent, allowing up to seven days between changes, depending on the wound status. This can mean a substantial reduction in labor and dressing costs.</li>\r\n<li>PolyMem\'s dressings provide a clear built-in visual indication of when they need to be changed, taking the guesswork out of patient care.</li>\r\n<li>Because of PolyMem\'s built-in cleansing and absorption capabilities, you may be able to change dressings less often and reduce wound bed cleansing during those changes, saving you precious time.</li>\r\n</ul>','<p>Highly absorbent foam dressings having built-in cleansing and absorption capabilities.  </p>','polymem-shapes',NULL,NULL,'PolyMem Shapes','PolyMem Shapes',NULL,NULL),
