('50','1','1','<p class=\"bodyplain\">Hydrofera Blue is a simple, safe, effective and proven moist wound dressing. It is constructed of polyvinyl alcohol (PVA) sponge complexed with two organic pigments, which provide broad-spectrum bacteriostatic protection. The pigments (Methylene Blue and Gentian Violet) have been used safely in medicine for over 50 years and have proven effective against a variety of microorganisms including MRSA and VRE.</p>\r\n<p class=\"bodyplain\">Hydrofera Blue has been approved for use on all types of wounds except third degree burns. Hydrofera Blue is intended for use on complex wounds and, in trials, has shown excellent results in treatment of wounds r/t Pyoderma, radiation burns, chemical burns, venous stasis ulcers, yeast infections, folliculitis and infected wounds. It can also be used to provide a safer moist environment for optimum wound healing on non-infected wounds.</p>\r\n<p class=\"bodyplain\">Hydrofera Blue is highly absorptive. In addition to being bacteriostatic, its open cell structure provides capillary vacuum action to draw excess fluid and exudates from the wound bed. Hydrofera Blue must be moistened with sterile saline or sterile water, squeezed out and secured to the wound bed with an appropriate secondary dressing. When kept moist, Hydrofera Blue is incredibly soft and comfortable for the patient. Other attributes of the dressing include gentile self-debridement of necrotic tissue and odor control through prevention of the growth of odor causing bacteria on the sponge. Dressings should be changed every 1 to 3 days following good wound care practice. In cases of high infection, the dressing may require more frequent change, indicated by the dressing changing color from blue to white.</p>\r\n<p>Hydrofera Blue has been <strong>approved for use on all types of wounds</strong> <strong>except third degree burns</strong>. Hydrofera Blue is intended for use on complex wounds and has shown excellent results in trials for treatment of wounds (Pyoderma - radiation burns - chemical burns - venous stasis ulcers - yeast infections - folliculitis - infected wounds). Hydrofera Blue can be used to provide a safe moist environment for optimum wound healing on non-infected wounds. Hydrofera Blue is highly absorptive. In addition to being bacteriostatic the Hydrofera Blue open cell structure provides capillary vacuum action to draw excess fluid and exudate from the wound bed. Hydrofera Blue must be moistened with sterile saline or sterile water then squeezed out and secured to the wound bed with an appropriate secondary dressing. Hydrofera Blue is incredibly soft and comfortable for the patient (must be kept moist). Other attributes of Hydrofera Blue include gentle self-debridement of necrotic tissue and pain relief. Hydrofera Blue also provides odor control through prevention of the growth of odor-causing bacteria on the sponge. Hydrofera Blue dressings should be changed every 1 to 3 days following good wound care practice.</p>\r\n<p>A secondary dressing is required to hold Hydrofera Blue in place.</p>','<p class=\"bodyplain\">Hydrofera Blue is a simple, safe, effective and proven moist foam dressing. It is constructed of polyvinyl alcohol (PVA) sponge complexed with two organic pigments, which provide broad-spectrum bacteriostatic protection. </p>','hydrofera-blue','bacteriostatic foam dressing','gentian violet,absorbent,pain','Hydrofera Blue','Hydrofera Blue',NULL,NULL),
('50','1','2','<p>Hydrofera Blue has been approved for use on all types of wounds except third degree burns. Hydrofera Blue is intended for use on complex wounds and has shown excellent results in trials for treatment of wounds (Pyoderma - radiation burns - chemical burns - venous stasis ulcers - yeast infections - folliculitis - infected wounds). Hydrofera Blue can be used to provide a safe moist environment for optimum wound healing on non-infected wounds. Hydrofera Blue is highly absorptive. In addition to being bacteriostatic the Hydrofera Blue open cell structure provides capillary vacuum action to draw excess fluid and exudate from the wound bed. Hydrofera Blue must be moistened with sterile saline or sterile water then squeezed out and secured to the wound bed with an appropriate secondary dressing. Hydrofera Blue is incredibly soft and comfortable for the patient (must be kept moist). Other attributes of Hydrofera Blue include gentle self-debridement of necrotic tissue and pain relief. Hydrofera Blue also provides odor control through prevention of the growth of odor-causing bacteria on the sponge. Hydrofera Blue dressings should be changed every 1 to 3 days following good wound care practice. A secondary dressing is required to hold Hydrofera Blue in place.</p>','<p>Hydrofera Blue has been approved for use on all types of wounds except third degree burns. Hydrofera Blue is intended for use on complex wounds. Examples of wounds that can be treated include radiation or chemical burns and yeast infections or infected wounds.</p>','hydrofera-blue',NULL,NULL,'Hydrofera Blue','Hydrofera Blue',NULL,NULL),
