('57','1','1','<p>An all-in-one sterile dressing that features a breathable soft cloth tape backing with a unique non-adherent pad. Medipore +Pad soft cloth adhesive wound dressing may be used as a primary or secondary dressing over light to moderately draining wounds. Also for securing devices or for protecting I.V. catheter sites. This all-in-one sterile dressing is a highly conformable absorbent dressing that provides superior patient comfort as dressing flexes with body movement and contours. Medipore +Pad dressing has a hypoallergenic and non-latex adhesive that provides excellent adhesion yet is gentle to the skin. The dressing features a unique non-adherent pad that is designed to promote normal wound healing processes  with less pain and trauma upon removal.</p>','<p>An all-in-one sterile dressing that features a breathable soft cloth tape backing with a unique non-adherent pad.</p>','medipore-bordered-gauze',NULL,NULL,'Medipore Bordered Gauze','Medipore Bordered Gauze',NULL,NULL),
