('61','1','1','<p>Tegaderm Matrix dressing is a unique and affordable wound care solution that aids in the management of hard-to-heal wounds. It is designed to help jump-start wounds and enable the wound to progress through the normal healing cascade. The dressing is indicated for use with chronic and non-infected wounds including: diabetic ulcers and pressure ulcers (stages II-IV) and venous stasis ulcers. Tegaderm Matrix dressing is the first advanced wound care solution that utilizes the innovative PHI technology. This technology consists of a unique blend of cations found naturally in the body including potassium and zinc and calcium and rubidium. The unique formulation helps promote the natural moisture balance needed for chronic wound healing. Benefits :: Easy to apply and remove: safe and effective.</p>\r\n<p>www.3m.com</p>\r\n<p>Secondary dressing required to hold in place.</p>','<p>Tegaderm Matrix dressing is a unique, affordable wound care dressing that aids in the management of hard-to-heal wounds such as diabetic ulcers.</p>','tegaderm-matrix',NULL,NULL,'Tegaderm Matrix','Tegaderm Matrix',NULL,NULL),
