('62','1','1','<p>A woven and nylon fabric with sealed edges that is non-adherent and also non-irritating and hypoallergenic. The wound contact material is placed over the wound and under gauze or other absorbent dressing. Tegaderm Contact Layer is a woven nylon fabric with sealed edges that is a lint-free, non-adherent, non-toxic,  non-irritating and hypoallergenic. Clinical studies show that Tegaderm Contact Layer can be left on the wound for up to 7 days. Tegaderm Contact Layer can be used under gauze or other absorbent dressings. It allows exudates to pass through to an absorbent outer barrier. The non-adherence of this material will minimize disruption of healthy granulation tissue and re-epithelialized surfaces.</p>\r\n<p>Requires a secondary dressing to hold in place.</p>','<p>A woven nylon fabric with sealed edges that is non-adherent, non-irritating and hypoallergenic. The wound contact material is placed over the wound and under gauze or other absorbent dressing.</p>','tegaderm-non-adherent-contact-layer',NULL,NULL,'Tegaderm Non-Adherent Contact Layer','Tegaderm Non-Adherent Contact Layer',NULL,NULL),
