('74','1','1','<p>MEDIHONEY hydrocolloid sheet dressings are a unique line of dressings containing Active Leptospermum Honey from New Zealand and Australia. They have been shown to possess unique qualities that make them ideal for the management of chronic and acute wounds and burns. MEDIHONEY dressings are able to work in the presence of wound fluid and blood and tissue. They promote an optimal healing environment because they contain a very high percentage of Leptospermum honey. MEDIHONEY dressings provide a moist and occlusive environment conducive to optimal wound healing.</p>\r\n<p>The dressings are indicated for the management of moderate to heavily exuding wounds such as: :: diabetic foot ulcers :: Venous stasis leg ulcers :: Arterial leg ulcers :: Leg ulcers of mixed etiology :: Pressure ulcers (I-IV) :: 1st and 2nd degree burns :: Donor sites :: Traumatic and surgical wounds.</p>\r\n<p>www.dermasciences.com</p>\r\n<p>May be used as a primary or secondary dressing.</p>','<p>Medihoney Hydrocolloid sheet contains 80% active medical-grade Leptospermum Honey in a hydrocolloid sheet form to absorb light to moderate drainage.</p>','medihoney-hydrocolloid-sheet',NULL,NULL,'MEDIHONEY Hydrocolloid Sheet','MEDIHONEY Hydrocolloid Sheet',NULL,NULL),
