('75','1','1','<p><span class=\"highlight\" style=\"font-family: \'arial black\', \'avant garde\'; font-size: 12pt;\"><strong>80% Active <em>Leptospermum</em> Honey and 20% natural gelling agents.</strong> </span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">• More viscous formulation with increased stability at the site of the wound </span><br /><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">• Demonstrated positive clinical outcomes</span><br /><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">• Optimal for superficial to full thickness wounds</span></p>\r\n<p><br /><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong>MEDIHONEY® </strong>dressings are a unique line of dressings containing Active Leptospermum Honey from New Zealand and Australia. They have been shown to possess unique qualities that make them ideal for the management of chronic and acute wounds and burns. MEDIHONEY® dressings are able to work in the presence of wound fluid and blood and tissue. They promote an optimal healing environment because they contain a very high percentage of Leptospermum honey. MEDIHONEY dressings provide a moist and occlusive environment conducive to optimal wound healing. Due to their versatility and lack of toxicity, <strong><span class=\"highlight\">MEDIHONEY®</span> </strong>dressings can be used in all stages of wound healing, and can also be used as an important component of wound bed preparation. As such, placing these dressings as the cornerstones of a wound care formulary can take a great deal of the guess-work out of wound management.</span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">The dressings are indicated for the management of moderate to heavily exuding wounds such as:  diabetic foot ulcers, Venous stasis leg ulcers, Arterial leg ulcers, Leg ulcers of mixed etiolog, Pressure ulcers (I-IV),  1st and 2nd degree burns, Donor sites, Traumatic and surgical wounds.</span></p>\r\n<p><span style=\"text-decoration: underline; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">www.dermasciences.com</span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Requires a secondary dressing to cover.</span></p>','<p><strong><span class=\"highlight\" style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">80% Active <em>Leptospermum</em> Honey and 20% natural gelling agents </span></strong></p>\r\n<p><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Optimal for partical to full thickness wounds</span><br /><br /></p>','medihoney-hydrocolloid-tube',NULL,NULL,'MEDIHONEY Hydrocolloid Tube','MEDIHONEY® Gel ',NULL,NULL),
('75','1','2','<p>MEDIHONEY dressings are a unique line of dressings containing Active Leptospermum Honey from New Zealand and Australia. They have been shown to possess unique qualities that make them ideal for the management of chronic and acute wounds and burns. MEDIHONEY dressings are able to work in the presence of wound fluid and blood and tissue. They promote an optimal healing environment because they contain a very high percentage of Leptospermum honey. MEDIHONEY dressings provide a moist and occlusive environment conducive to optimal wound healing. As wound exudate is absorbed the alginate forms a gel making the Medihoney dressings easy to remove without disrupting the wound bed. The dressings are indicated for the management of moderate to heavily exuding wounds such as: :: diabetic foot ulcers :: Venous stasis leg ulcers :: Arterial leg ulcers :: Leg ulcers of mixed etiology :: Pressure ulcers (I-IV) :: 1st and 2nd degree burns :: Donor sites :: Traumatic and surgical wounds. www.dermasciences.com</p>','<p>This form of Medihoney Hydrocolloid contains 100% active medical-grade Leptospermum Honey in a tube. Medihoney hydrocolloid tube is a safe dressing for hard-to-dress wounds that may have tunneling or undermining.</p>','medihoney-hydrocolloid-tube',NULL,NULL,'MEDIHONEY Hydrocolloid Tube','MEDIHONEY Hydrocolloid Tube',NULL,NULL),
