('76','1','1','<p>FlexiCol handles wound drainage with a combination of absorption and evaporation. FlexiCol stays secure for days after its first application so re-application or securing with tape is eliminated. FlexiCol\'s thin film exterior and moist core allow for higher and quicker fluid uptake so most residue does not remain in the wound. Peel-off tabs and a thin beveled edge make application quick and prevent dressing roll-up. FlexiCol folds easily to conform to difficult-to-dress areas.</p>','<p>FlexiCol handles wound drainage with a combination of absorption and evaporation.  FlexiCol stays secure for days after its first application so re-application or securing with tape is eliminated.</p>','flexicol',NULL,NULL,'FlexiCol','FlexiCol',NULL,NULL),
('76','1','2','<p>FlexiCol handles wound drainage with a combination of absorption and evaporation. FlexiCol stays secure for days after its first application so re-application or securing with tape is eliminated. FlexiCol\'s thin film exterior and moist core allow for higher and quicker fluid uptake so most residue does not remain in the wound. Peel-off tabs and a thin beveled edge make application quick and prevent dressing roll-up. FlexiCol folds easily to conform to difficult-to-dress areas and is available in two shaped dressings for wounds on the sacrum and heels or elbows.</p>','<p>FlexiCol handles wound drainage with a combination of absorption and evaporation. Unlike other dressings that tend to pull away soon after application FlexiCol stays secure for days after its first application so re-application or securing with tape is eliminated.</p>','flexicol',NULL,NULL,'FlexiCol','FlexiCol',NULL,NULL),
