('77','1','1','<p>These dressings mix with wound exudate to form a soft mass that allows for easy removal while protecting the wound from outside contamination from bacteria, fecal matter or urine. A moist wound environment is created that is conducive to wound healing. The foam backing provides an extra layer of cushioning and comfort, and tapered edges that are designed to minimize bunching and rolling up. This leads to improved wear times and cost-effectiveness. Use for the management of lightly exuding pressure ulcers (Stage I-IV), diabetic foot ulcers, venous stasis ulcer and other chronic and acute wounds.</p>\r\n<p>May be used as a primary or secondary dressing.</p>','<p>These dressings mix with wound exudate to form a soft mass that allows for easy removal while protecting the wound from outside contamination from bacteria, fecal matter or urine.</p>','primacol-hydocolloid-dressing',NULL,NULL,'PRIMACOL Hydocolloid Dressing','PRIMACOL Hydocolloid Dressing',NULL,NULL),
