('79','1','1','<p>Tegaderm Hydrocolloids are sterile wound dressings which consist of a hypoallergenic and hydrocolloid adhesive along with an outer clear adhesive cover film impermeable to liquids, bacteria and viruses. The inner layer of hydrocolloid adhesive rapidly absorbs exudate faster than the leading competitive hydrocolloid in the first 48 hours. The breathable outer film layer provides a consistently high rate of moisture vapor transmission. These features ensure an optimal moist wound environment, minimize the chance for damage to healthy periwound skin and provide extended wear for up to seven days.</p>','<p>Tegaderm Hydrocolloids are sterile wound dressings which consist of a hypoallergenic and hydrocolloid adhesive along with an outer clear adhesive cover film impermeable to liquids, bacteria and viruses.</p>','tegaderm-hydrocolloid-dressing',NULL,NULL,'Tegaderm Hydrocolloid Dressing','Tegaderm Hydrocolloid Dressing',NULL,NULL),
