('82','1','1','<p>Sorbact Gel dressings are used to prevent or eliminate infection in dry to low-exudating wounds, burns or fungal infections without the use of silver. Sorbact selectively binds and inactivates pathogenic microorganisms through a natural binding process. Sorbact technology builds on the physical forces that make two hydrophobic (water-repellent) particles bind together when in direct contact utilizing the binding force of surrounding water molecules. The green surface of Sorbact has a unique property that binds and inactivates pathogenic microorganisms. Microorganisms bind to Sorbact within 15-30 seconds of application and become inactivated creating a microbiological balance that is favorable for the wound healing process. Binding and inactivation continues until Sorbact is removed and replaced.</p>','<p>Sorbact Gel dressings are used to prevent or eliminate infection in dry to low-exudating wounds, burns and fungal infections without the use of silver. Sorbact selectively binds and inactivates pathogenic microorganisms through a natural binding process.</p>','sorbact-gel',NULL,NULL,'Sorbact Gel','Sorbact Gel',NULL,NULL),
