('84','1','1','<p>Hydrogel sheet designed for the breast provides scar reduction and improved healing after breast reconstruction or augmentation surgeries. Provides cooling relief after radiation or aesthetic treatments on face and neck.</p>\r\n<p>Spand-Gel primary wound hydrogel dressingd provide a moist and cool wound-healing environment to promote granulation tissue formation and relieve pain, burning, itching and soreness. Provides a barrier from exogenous bacteria and fluids and does not adhere to tissue.  Spand-Gel absorbs wound exudates up to 3 times its weight.</p>\r\n<p>Spand-Gel comes in <span style=\"text-decoration: underline;\">specialized shapes and sizes</span> to fit any area. This cool hydrogel sheet may be used in conjunction with MediSoothe Lotion. Best when cooled in the refrigerator for 30 minutes before using to provide soothing and cooling relief and a more comfortable recovery. This product may be rinsed off and placed in a zip-locked bag and refrigerated for later use.</p>\r\n<p><span style=\"text-decoration: underline;\">www.meditechintl.com</span></p>\r\n<p>Secondary dressing required to hold in place. (see Spandage tapeless retention)</p>','<p>Spand-Gel hydrogel dressings are shaped for the face, breast, neck and more. Provide a moist, cool wound-healing environment to promote granulation tissue formation, burn relief after radiation or aesthetic treatments and reduced scarring.</p>','spand-gel','Cooling, soothing hydrogel sheet shapes that fit the face, breast, neckand other areas and provide wound scar-reduction, relief from radiation and faster healing after aesthetic procedures.',NULL,'Spand-Gel','Spand-Gel',NULL,NULL),
('84','1','2','<p>Spand-Gel primary wound hydrogel dressing provides a moist and cool wound-healing environment to promote granulation tissue formation. It relieves pain and burning and itching and soreness. Spand-Gel absorbs wound exudates 3 times its weight. Provides a barrier from exogenous bacteria and fluids and does not adhere to tissue. Spand-Gel comes in specialized shapes and sizes to fit any area. This cool and aloe-based hydrogel sheet may be used in conjunction with Burn Block Lotion. Best when cooled in the refrigerator for 30 minutes before using to provide soothing and cooling relief and a more comfortable recovery. This product may be rinsed off and placed in a zip-locked bag and refrigerated for later use. Secondary dressing required to hold in place. www.medi-techintl.com.</p>','<p>Spand-Gel primary wound hydrogel dressing provides a moist cool wound-healing environment to promote granulation tissue formation. Secondary dressing required to hold in place.</p>','spand-gel',NULL,NULL,'Spand-Gel','Spand-Gel',NULL,NULL),
