('85','1','1','<p>Dermagran Hydrophilic contains nutrients such as zinc and vitamin B6 that play an important role in tissue repair. Dermagran Hydrophilic dressing is useful for rehydrating sloughy or necrotic tissue and enhancing autolytic debridement. Dermagran provides a moist  and mildly acidic wound environment that is conducive to wound healing on minimally draining wounds and may be used as a  filler for chronic and acute wounds. The zinc-nutrient dressing formulation and balanced pH technology of Dermagran products contain Vitamin A, Vitamin B6,calcium and Magnesium. Dermagran may be used for the management of pressure ulcers.</p>\r\n<p>Requires a secondary dressing to cover.</p>','<p>Dermagran Hydrophilic contains nutrients such as zinc and vitamin B6 that play an important role in tissue repair. Dermagran Hydrophilic dressing is useful for rehydrating sloughy or necrotic tissue and enhancing autolytic debridement.</p>','dermagran-hydrophillic',NULL,NULL,'Dermagran Hydrophillic','Dermagran Hydrophillic',NULL,NULL),
