('87','1','1','<p>A hydrophilic Maltodextrin NF wound dressing clinically proven to promote epithelial proliferation and granulation tissue. Quickly fills wound site and rapidly mixes with exudate to form a protective coating that maintains an ideal moisture balance to protect against dehydration. Available as a gel for dry and minimally draining wounds. For use on all wound types. Can be used on infected or hard-to-heal wounds. Specifically formulated to provide topical nutrients to wound sites and create a natural healing environment. Non-toxic and not systemically absorbed. Controls odor while decreasing purulent exudate. Penetrates all wound irregularities to fill tunneling and undermining. Softens necrotic tissue to facilitate debridement.</p>\r\n<p>Requires a secondary dressing to cover.</p>','<p>A hydrophilic Maltodextrin NF wound dressing clinically proven to promote the growth of granulation tissue and epithelial proliferation. Quickly fills wound site rapidly mixing with exudate to form a protective coating that maintains an ideal moisture balance to protect against dehydration.</p>','multidex-maltodextrin-gel',NULL,NULL,'Multidex Maltodextrin Gel','Multidex Maltodextrin Gel',NULL,NULL),
