('91','1','1','<p>Mesalt supports the cleansing of moderately to heavily discharging wounds including infected wounds. </p>\r\n<p>How Mesalt works: The discharge from the wound releases the sodium chloride from the dressing. Mesalt effectively stimulates the cleansing of wounds in the inflammatory phase by absorbing exudate, bacteria and necrotic material from the wound and thereby facilitates the natural wound healing process .Easy application.</p>\r\n<p>Areas of use: Mesalt is intended for the management of heavily discharging, discharging infected wounds in the inflammatory phase and deep cavity wounds such as pressure ulcers and surgical wounds. </p>\r\n<p>Requires secondary dressings to hold in place.</p>','<p>Mesalt supports the cleansing of moderately to heavily discharging wounds including infected wounds.</p>','mesalt-impregnated-gauze',NULL,NULL,'Mesalt Impregnated Gauze','Mesalt Impregnated Gauze',NULL,NULL),
