('92','1','1','<p>DeRoyal Oil Emulsion Dressing is a sterile, non-adhering dressing made of knitted cellulose fabric impregnated with an oil emulsion blend. It is used as a primary dressing (goes directly in or on a wound). DeRoyal Oil Emulsion Dressing conforms to the wound site without sticking to fragile healing tissue while helping to maintain a moist wound environment conducive to healing. The knitted cellulose fabric is breathable and allows wound drainage to flow away from the wound site into the absorbent cover dressing thus minimizing maceration or irritation. DeRoyal Oil Emulsion Dressing is ideal for dry to heavily draining wounds.</p>\r\n<p>Requires a secondary dressing.</p>','<p>DeRoyal Oil Emulsion Dressing is a sterile, non-adhering dressing made of knitted cellulose fabric impregnated with an oil emulsion blend. </p>','deroyal-oil-emulsion-dressing',NULL,NULL,'DeRoyal Oil Emulsion Dressing','DeRoyal Oil Emulsion Dressing',NULL,NULL),
