('95','1','1','<p>Oil Emulsion impregnated dressings are designed to provide non-adherent dressing for wounds and also provide a moist environment conducive to wound healing. They are made of a knitted cellulose acetate fabric coated with a formulated petrolatum emulsion. The knitted fabric allows wound fluid to move through the dressing and into a secondary absorbent dressing. Oil Emulsion dressings are non-adherent. Removal of these dressings causes minimal trauma to the wound bed and patient. Oil Emulsion dressings are commonly used for the management many types of wounds: skin grafts - surgical sites -abrasions lacerations - dermal ulcers - cosmetic surgery sites. Latex Free.</p>\r\n<p>Requires a secondary dressing.</p>','<p>Oil Emulsion impregnated dressings are designed to provide non-adherent dressing for wounds providing a moist environment conducive to wound healing. They are made of a knitted cellulose acetate fabric coated with a formulated petrolatum emulsion.</p>','shur-conform-oil-emulsion-impregnated-gauze',NULL,NULL,'SHUR-CONFORM Oil Emulsion Impregnated Gauze','SHUR-CONFORM Oil Emulsion Impregnated Gauze',NULL,NULL),
