('112','1','1','<p>Mefix Fabric ape  is skin-friendly and has perforated split in protection paper for easy handling. This tape has a waterbased and solvent-free polyacrylate adhesive for secure and gentle fixation, is soft, elastic, nonabsorbent and nonwoven for patient comfort.,</p>\r\n<p><span style=\"font-size: 12px; line-height: 1.5em;\">Areas of use - Mefix can be used in a wide variety of situations where fixation is required (including fixation of dressings - swabs - catheters - tubes). How Mefix works - The porous structure of the nonwoven fabric ensures air and water vapour permeability. The fabric is flexible and confirms well to body contours. It allows body movements when in place. The fabric is non-absorbent and provides a barrier for blood and fluid strike-through. The easy-to-remove protection paper is pre-measured in 10 cm intervals and has a perforated split for easy removal and application. Mefix can easily be cut to the desired shape and size.</span></p>','<p>Mefix Fabric Tape has a waterbased, solvent-free polyacrylate adhesive for skin-friendly, secure and gentle fixation.</p>','mefix-fabric-tape',NULL,NULL,'Mefix Fabric Tape','Mefix Fabric Tape',NULL,NULL),
