('122','1','1','<p>Elastic bandages made of cotton/poly blend yarn are breathable, durable and absorbent and will stretch up to 210 percent without loss of elasticity. Bandage ends are scalloped and rolled to help prevent \"roll\" and venous tourniquet effect.</p>','<p>Elastic bandages made of cotton/poly blend yarn are breathable, durable and absorbent and will stretch up to 210 percent without loss of elasticity. Bandage ends are scalloped and rolled to help prevent \"roll\" and venous tourniquet effect.</p>\r\n<ul>\r\n<li>Latex-free bandages include a center honey-colored stripe and teal end-stitching self-closure that replaces clips and an exclusive knit design that provides comfortable, controlled and consistent compression.</li>\r\n<li>The single-strip closure eliminates the need for clips.</li>\r\n</ul>\r\n<p> </p>','reliamed-easy-wrap-elastic-bandage-with-velcro',NULL,NULL,'ReliaMed Easy Wrap Elastic Bandage with Velcro','Easy Wrap Elastic Bandage with Velcro',NULL,NULL),
