('126','1','1','<p>Breathable transparent self-adhesiveMepore Film is a transparent self-adhesive film dressing ideal as secondary fixation dressing and as primary dressing for a wide range of clean wounds. Mepore Film\'s application system is designed for ease-of-use. Mepore Film provides a flexible and transparent covering to protect the wound and conforms to surface irregularities and body contours. The film provides a barrier to fluid strike-through and viral and bacterial contamination. Mepore Film maintains a moist environment in the wound and allows excess moisture to pass away from the wound and surrounding skin because of its high vapor permeability</p>\r\n<p>Benefits: Supporting protection foil and paper frame for ease of application transparent and breathable and elastic polyurethane film for patient comfort and optimized wound healing. <span style=\"font-size: 12px; line-height: 1.5em;\">Has a skin-friendly adhesive for gentle, secure fixation. This viral and bacteria-proof film is </span><span style=\"font-size: 12px; line-height: 1.5em;\">impermeable to fluids for a safe and protective healing environment.</span></p>','<p>Breathable, transparent self-adhesive film dressing Mepore Film is  ideal as secondary fixation dressing and as primary dressing for a wide range of clean wounds. Mepore Film\'s application system is designed for ease-of-use.</p>','mepore-film',NULL,NULL,'Mepore Film','Mepore Film',NULL,NULL),
