('129','1','1','<p>TRANSEAL Wound Dressing is a transparent polyurethane film coated with an acrylic pressure-sensitive adhesive that acts like a second skin to help control the environment in which the wound will heal. TRANSEAL is highly permeable to gases and moisture vapor which allows the skin to breathe and moisture to transmit from the site. It is impermeable to water and bacteria. TRANSEAL has an easy and two-step delivery system. TRANSEAL uses a carrier film that maintains the integrity of the dressing and ensures proper application every time. The carrier film is transparent which allows for accurate positioning over the wound site. It can be used as a tracing device to document wound measurements. TRANSEAL has been developed to have a very high moisture vapor transmission rate. A high MVTR will reduce the pooling of drainage under the film that can cause infection at the site or maceration of the peri-wound skin. TRANSEAL will allow moisture to transmit from the wound site at a faster rate but will keep the site moist enough to maintain an environment conducive to healing.</p>','<p>TRANSEAL Wound Dressing is a transparent polyurethane film coated with an acrylic pressure-sensitive adhesive that acts like a second skin in controlling the environment for optimal healing. Impermeable to water and bacteria.</p>','transeal-wound-dressing',NULL,NULL,'Transeal Wound Dressing','Transeal Wound Dressing',NULL,NULL),
