('133','1','1','<p>A hydrophilic Maltodextrin NF wound dressing clinically proven to promote the growth of granulation tissue and epithelial proliferation in moist and wet wounds. It will rapidly mix with exudate to form a protective coating that maintains an ideal moisture balance to protect against dehydration.  For use on all wound types especially infected hard-to-heal wounds. Specifically formulated to provide topical nutrients to wound sites. Non-toxic and not systemically absorbed. Controls odor while decreasing purulent exudate, penetrates all wound irregularities to fill tunneling and undermining, and softens necrotic tissue to facilitate debridement. Primary dressing.</p>\r\n<p>Secondary dressing required to hold in place.</p>','<p>A hydrophilic Maltodextrin NF wound dressing clinically proven to promote the growth of granulation tissue and epithelial proliferation in moist and wet wounds.</p>','multidex-hydrophilic-powder',NULL,NULL,'Multidex Hydrophilic Powder','Multidex Hydrophilic Powder',NULL,NULL),
