('135','1','1','<p><span>Silverlon</span><span> Acute Burn Gloves have open fingers and are oversized 20% for use immediately after acute injury or post surgery for both partial to full thickness burns. They offer broad antimicrobial protection to often hard to dress parts of the hand. </span><br /><br /><span>Silverlon</span><span> Acute Burn Gloves are designed for use immediately after acute injury or post surgery of the hands. The Burn Gloves provide for quick and easy dressing applications to fingers and hands. Silverlon</span><span> Acute Burn Gloves are offered in  sizes to fit virtually all hands: </span><span style=\"font-size: 12px; line-height: 1.5em;\">Pediatric, Small, Medium, Large</span></p>\r\n<p><br /><span>The Silverlon</span><span> Acute Burn Glove is indicated for 1st and 2nd Degree Burns, Partial and Full-thickness Wounds, Donor and Graft Sites, Acute Wounds, Lacerations, Abrasions, Traumatic Wounds, Surgical Wounds, Dehisced Wounds, Pressure Ulcers, Diabetic Ulcers, and Venous Ulcers. Silverlon</span><span> Burn Gloves are currently used in Burn Treatment Centers and Hospitals throughout the USA and Canada.</span></p>','<p>Silverlon<span style=\"font-size: xx-small;\"> </span>Acute Burn Gloves have open fingers and are oversized 20% for use immediately after acute injury or post surgery for both partial to full thickness burns. They offer broad antimicrobial protection to hard-to-dress parts of the hand.</p>','silverlon-acute-burn-gloves','Burns on hands are made painless and heal without infection when using this unique burn glove that contains ionic silver for infection control and pain-reduction.',NULL,NULL,'Silverlon Acute Burn Gloves',NULL,NULL),
