('141','1','1','<p><span>Biogard roll conforming gauze features a novel cationic biocide that kills pathogens within the dressing and provides a barrier to bacterial penetration.  These dressings provide protection  from external contaminants, a reduction in bacteria and other pathogens from wound fluid, and also protect against cross-contamination to the caregiver during dressing changes.</span></p>','<p>Conforming bandage features a biocide that kills pathogens within the dressing and protects against outside contaminants.</p>','biogard-antimicrobial-gauze-sponges',NULL,NULL,NULL,'BIOGARD  Antimicrobial Gauze Sponges',NULL,NULL),
