('145','1','1','<p> <strong style=\"font-size: 12px; line-height: 1.5em;\">Anasept 3oz.</strong></p>\r\n<p>Anasept Antimicrobial Skin and Wound Gel is an extremely safe topical hydrogel with exceptionally rapid broad spectrum bactericidal and fungicidal and virucidal properties. Anasept Gel rapidly eliminates antibiotic-resistant strains MRSA and VRE and other dangerous micro-organisms.</p>\r\n<p>Anasept Gel may be used for the following wound types: pressure ulcers (stage I-IV) , cuts and abrasions, surgical incisions/wounds, diabetic foot ulcers,  first and second degree burn, venous stasis ulcers, grafted wounds, and donor sites. Anasept Gel may be used for irritated skin or rashes.</p>\r\n<p>Anasept <span>Antimicrobial Skin and Wound Gel is indicated for use by Health Care Professionals in the management of wounds.</span></p>\r\n<p>For more information view</p>\r\n<p><a title=\"Anasept gel\" href=\"http://admedonline.com/wound-care/80-anasept-gel.html\">Anasept Gel</a></p>\r\n<p><strong>30 4\" x 4\" Bordered Gauze - </strong><span style=\"font-size: 12px; line-height: 1.5em;\">Non-adherent contact layer with absorbent 100% cotton pad covered with an adhesive-coated nonwoven tape overlay. Latex-free.</span></p>\r\n<p>For more information view</p>\r\n<p><a title=\"Reliamed Bordered Gauze\" href=\"http://admedonline.com/wound-care/59-reliamed-bordered-gauze.html\">ReliaMed Bordered Gauze</a></p>\r\n<p><strong><br /></strong></p>','<p>3oz tube of Anasept Gel and 30 4x4 bordered gauze. Rapid elimination of bacteria, virus, fungus including MRSA.</p>','anasept-gel-and-bordered-gauze',NULL,NULL,NULL,'Anasept Gel and Bordered Gauze',NULL,NULL),
