('146','1','1','<p><strong>Anasept 3oz.</strong></p>\r\n<p> <span style=\"font-size: 12px; line-height: 1.5em;\">Anasept Antimicrobial Skin and Wound Gel is an extremely safe topical hydrogel with exceptionally rapid broad spectrum bactericidal and fungicidal and virucidal properties. Anasept Gel rapidly eliminates antibiotic-resistant strains MRSA and VRE and other dangerous micro-organisms.</span></p>\r\n<p>Anasept Gel may be used for the following wound types: pressure ulcers (stage I-IV) , cuts and abrasions, surgical incisions/wounds, diabetic foot ulcers,  first and second degree burn, venous stasis ulcers, grafted wounds, and donor sites. Anasept Gel may be used for irritated skin or rashes. Anasept may be used on wounds having no drainage to moderate levels of drainage as it has some absorptive capacity. <em style=\"font-size: 12px; line-height: 1.5em;\">Anasept Antimicrobial Skin and Wound Gel is indicated for use by Health Care Professionals in the management of wounds.</em></p>\r\n<p><strong>30 Gauze Sponges</strong></p>\r\n<p> Sterile Latex-free sponges made from 100% USP cotton. Ideal for wound cleansing and as secondary dressings for added absorbency. Highly absorbent rayon/polyester blend provides fast wicking properties and minimizes skin maceration. Suitable for debriding and covering and packing wounds or general use. Sterile and latex-free.</p>\r\n<p><strong>Bulky Roll Gauze</strong></p>\r\n<p> Gazetex washed and low-linting woven gauze rolls are used for wrapping or packing large and deep wounds. When used as a primary dressing Gazetex rolls provide fast wicking and absorbency and aeration. This gauze dressing provides additional cushioning and comfort when used as a secondary dressing. Latex Free. Available in 6-ply Non-Sterile (NS) and Sterile (ST) rolls.</p>\r\n<p><strong>2\" Tape</strong></p>\r\n<p>ReliaMed Paper Tape is easy to tear with a natural porosity which allows skin to breathe. Ideal for situations involving frequent re-taping.</p>',NULL,'anasept-gel-gauze-sponges-bulky-roll-gauze-and-2-tape',NULL,NULL,NULL,'Anasept Gel, Gauze Sponges, Bulky Roll Gauze, and 2\" Tape',NULL,NULL),
