('151','1','1','<ul>\r\n<li>Reduces bacterial colonization associated with catheter related infections</li>\r\n<li>Absorbs moisture around the catheter insertion site</li>\r\n<li>Sterile patch of polyurethane foam coated with an ionic silver alginate and maltodextrin matrix</li>\r\n<li>Releases active ionic silver for broad antimicrobial effectiveness</li>\r\n<li>Does NOT require activation</li>\r\n<li>Up to seven days wear time</li>\r\n<li>Non-irritating</li>\r\n<li>Non-staining</li>\r\n</ul>\r\n<p><strong><span class=\"orange\">INDICATIONS:  </span> </strong>Dialysis catheters, Central venous lines, Arterial catheters, External fixator pins, Epidural catheters, Peripheral IV catheters, Gastrostomy feeding tubes, Non-vascular percutaneous devices</p>','<p>Algidex Ag catheter patches reduce bacterial colonization associated with catheter-related infections by releasing ionic silver for broad antimicrobial effectiveness.</p>','algidex-ag-catheter-patch',NULL,NULL,NULL,'Algidex Ag Catheter Patch',NULL,NULL),
