('152','1','1','<p>DuoDERM is the only hydrocolloid dressing with both a Triple Hydrocolloid Matrix® and a viral/bacterial barrier. <span style=\"font-size: 12px; line-height: 1.5em;\">Translucent backing is designed to prevent needless dressing changes that can cause </span><span style=\"font-size: 12px; line-height: 1.5em;\">discomfort and disturb healing</span></p>\r\n<p>• Thin design is flexible and conformable<br />• Designed to promote a moist wound environment, which supports healing and prevents damage to <br />   new epithelium upon removal<br />• Moisture-resistant for ease of cleaning/showering<br />• Can be used as a primary or secondary dressing<br /><span>• Can be cut to shape</span></p>','<p>DuoDERM is the only hydrocolloid dressing with both a Triple Hydrocolloid Matrix® and a viral/bacterial barrier.  <span style=\"font-size: 12px; line-height: 1.5em;\">Translucent backing is designed to prevent needless dressing changes that can cause </span><span style=\"font-size: 12px; line-height: 1.5em;\">discomfort and disturb healing.</span></p>','duoderm-cfg-extra-this',NULL,NULL,NULL,'DuoDERM  Extra Thin',NULL,NULL),
