('153','1','1','<p><span>The Kendall Sorb-It I.V. Sponges have a pre-cut notch that conforms well around drains, catheters, chest tubes, I.V.\'s and tracheotomies. Sorb-It 2\"x2\" are 6 ply sterile sponges and are packaged in a box of 35 sealed packs, each pack contains 2 sponges. The smaller 2\"x2\" size eliminates the need for sterile scissors. These sponges are virtually lint free which minimizes the risk of wound contamination.</span></p>','<p>Kendall Sorb-it Drain Sponges conforms well around drains, catheters, chest tubes, IV\'s and tracheotomies. 6-ply ST.  Each packages contains 2 sponges.</p>','kendall-sorb-it-drain-sponge',NULL,NULL,NULL,'Kendall Sorb-it Drain Sponge',NULL,NULL),
