('154','1','1','<p><span>The <strong><span>Juxta-Lite</span></strong> is an easy alternative for those who lack the strength or dexterity to use traditional compression stockings. <strong>Q</strong></span><strong style=\"font-size: 12px; line-height: 1.5em;\">uick and easy application</strong><span style=\"font-size: 12px; line-height: 1.5em;\"> and </span><strong style=\"font-size: 12px; line-height: 1.5em;\">minimal adjustments</strong><span style=\"font-size: 12px; line-height: 1.5em;\"> increase patient compliance for treatment of venous Insufficiency. </span></p>\r\n<p><span style=\"font-size: 12px; line-height: 1.5em;\">The Juxta-Lite is engineered with the ability to be set to three compression levels (20-30, 30-40 or 40-50 mmHg) and is available in two lengths with sizes ranging from Small through XXL. The  compression anklet  is available in S and M sizes.</span></p>\r\n<p><span style=\"font-size: 12px; line-height: 1.5em;\"><span>Packages include</span><br /><span>Juxta-Lite™ Standard Legging, one pair of Comfort Compression Anklets™, one Comfort Leg Liner™, and one Built-in Pressure™ (BPS™) Guide Card.</span></span></p>\r\n<p><span style=\"font-size: 12px; line-height: 1.5em;\">The user-friendly design of Juxta-Lite enables patients to achieve the higher compression levels that are necessary to reduce ulcer occurance. The patented Juxta-Lock Band System allows for easy application and adjustment to assure the appropriate compression level.</span></p>\r\n<p><span style=\"font-size: 12pt;\"><strong><em>This product requires a signature upon delivery.</em></strong></span></p>\r\n<p><strong>PLEASE CALL OUR TOLL FREE NUMBER FOR SIZING ASSISTANCE:   </strong><strong style=\"font-size: 12px; line-height: 1.5em;\">Sizing requires                 </strong><strong style=\"font-size: 12px; line-height: 1.5em;\">ankle circumference measurement                                                                                           </strong></p>\r\n<p><strong style=\"font-size: 12px; line-height: 1.5em;\">calf circumference measurement                                                                                            </strong></p>\r\n<p><strong style=\"font-size: 12px; line-height: 1.5em;\">length measurement from floor to knee crease</strong></p>\r\n<p><strong> </strong></p>\r\n<p><strong><br /></strong></p>','<p>The <strong>Juxta-Lite</strong> knee-high \"standard legging\" compression garment is an easy alternative for those who lack the strength or dexterity to use traditional compression stockings. The patented Juxta-Lock Band System allows for easy application and adjustment to assure the appropriate compression level.</p>','circaid-juxta-lite',NULL,NULL,NULL,'Circaid Juxta-Lite Standard Legging',NULL,NULL),
