('159','1','1','<p><strong>Medihoney 4\" x 5\"  - one box of 10</strong></p>\r\n<p> </p>\r\n<p><span style=\"font-size: 12px; line-height: 1.5em;\">MEDIHONEY dressings are a unique line of dressings containing Active Leptospermum Honey from New Zealand and Australia. They have been shown to possess unique qualities that make them ideal for the management of chronic and acute wounds and burns. MEDIHONEY dressings are able to work in the presence of wound fluid or blood or tissue and promotes an optimal healing environment. As wound exudate is absorbed, the alginate forms a gel enabling easy removal without disrupting the wound bed. Medihoney dressings are indicated for the management of moderate to heavily exuding wounds such as diabetic foot ulcers,venous stasis leg ulcers, arterial leg ulcers, ulcers of mixed etiology, pressure ulcers (I-IV), 1st and 2nd degree burns, donor sites,traumatic and surgical wounds.   </span></p>\r\n<p><span style=\"font-size: 12px; line-height: 1.5em;\">                                                                                                                                              </span></p>\r\n<p><strong style=\"font-size: 12px; line-height: 1.5em;\">Should only be used for wounds with moderate to heavy drainage.</strong><span style=\"font-size: 12px; line-height: 1.5em;\"> </span><span style=\"text-decoration: underline;\">www.dermasciences.com</span></p>\r\n<p><span style=\"text-decoration: underline;\"><br /></span></p>\r\n<p><strong style=\"font-size: 12px; line-height: 1.5em;\">ABD Pads - 30 pcs.  5\" x 9\"  </strong><span style=\"font-size: 12px; line-height: 1.5em;\"> Dupad abdominal pads are filled with cellulose fibers making them super-absorbent. The fibers quickly absorb and disperse fluids laterally to prevent pooling and maceration. The backing is constructed of a hydrophobic material which prevents strike-through. All edges are sealed to prevent linting. Latex Free.</span></p>\r\n<p><span style=\"font-size: 12px; line-height: 1.5em;\"><br /></span></p>\r\n<p><strong style=\"font-size: 12px; line-height: 1.5em;\">Two rolls of 2\" Paper tape    </strong><span style=\"font-size: 12px; line-height: 1.5em;\">ReliaMed Paper Tape is easy to tear with a natural porosity which allows skin to breathe. Ideal for situations involving frequent re-taping.</span></p>',NULL,'medihoney-alginate-30-abd-pads-2-rolls-of-tape',NULL,NULL,NULL,'Medihoney Alginate, ABD Pads, Tape',NULL,NULL),
