('160','1','1','<p><strong>Medihoney Gel </strong></p>\r\n<p><span class=\"highlight\">80% Active <em>Leptospermum</em> Honey and 20% natural gelling agents. </span><br />MEDIHONEY dressings are a unique line of dressings containing Active Leptospermum Honey from New Zealand and Australia. They have been shown to possess unique qualities that make them ideal for the management of chronic and acute wounds and burns. MEDIHONEY dressings are able to work in the presence of wound fluid and blood and tissue. They promote an optimal healing environment because they contain a very high percentage of Leptospermum honey. MEDIHONEY dressings provide a moist and occlusive environment conducive to optimal wound healing. Due to their versatility and lack of toxicity, <span class=\"highlight\">MEDIHONEY®</span> dressings can be used in all stages of wound healing, and can also be used as an important component of wound bed preparation. As such, placing these dressings as the cornerstones of a wound care formulary can take a great deal of the guess-work out of wound management.</p>\r\n<p>The dressings are indicated for the management of moderate to heavily exuding wounds such as:  diabetic foot ulcers, Venous stasis leg ulcers, Arterial leg ulcers, Leg ulcers of mixed etiolog, Pressure ulcers (I-IV),  1st and 2nd degree burns, Donor sites, Traumatic and surgical wounds.</p>\r\n<p><strong style=\"font-size: 12px; line-height: 1.5em;\">Roll Gauze 30 rolls - </strong><span style=\"font-size: 12px; line-height: 1.5em;\">Gazetex washed and low-linting woven gauze rolls are used for wrapping or packing large and deep wounds. When used as a primary dressing Gazetex rolls provide fast wicking and absorbency and aeration. This gauze dressing provides additional cushioning and comfort when used as a secondary dressing. Latex Free. Available in 6-ply Non-Sterile (NS) and Sterile (ST) rolls.</span></p>\r\n<p><strong><span style=\"font-size: 12px; line-height: 1.5em;\">2 Rolls of 2\" Paper Tape - </span></strong><span style=\"font-size: 12px; line-height: 1.5em;\">ReliaMed Paper Tape is easy to tear with a natural porosity which allows skin to breathe. Ideal for situations involving frequent re-taping.</span></p>','<p>Medihoney Gel, ST roll gauze and tape.</p>','medihoney-hydrocolloid-st-roll-gauze-and-2-paper-tape',NULL,NULL,NULL,'Medihoney Gel, ST Roll Gauze, Tape',NULL,NULL),
