('164','1','1','<p><strong>Tegaderm Matrix - 10 Pcs 2\" x 2\"</strong><br />Tegaderm Matrix dressing is a unique and affordable wound care solution that aids in the management of hard-to-heal wounds,<strong> including diabetic ulcers</strong>.  It is designed to help jump-start wounds and enable the wound to progress through the normal healing cascade. The dressing is indicated for use with chronic and non-infected wounds including: <span style=\"text-decoration: underline;\">diabetic ulcers</span> and pressure ulcers (stages II-IV) and venous stasis ulcers. Tegaderm Matrix dressing is the first advanced wound care solution that utilizes the innovative PHI technology. This technology consists of a unique blend of cations found naturally in the body including potassium and zinc and calcium and rubidium. The unique formulation helps promote the natural moisture balance needed for chronic wound healing. Benefits :: Easy to apply and remove: safe and effective. </p>\r\n<p><strong>ST gauze sponges - 15 Pcs</strong><br />Dynarex STERILE gauze sponges combine superior quality with assured economy for a wide range of dressing and cleaning and prepping procedures. No exposed raw edges - cut edges folded in cotton-filled sponges provide<span style=\"line-height: 1.5em;\">maximum absorption.</span></p>\r\n<p><strong>1 Roll - 1\" Paper Tape </strong><br />ReliaMed Paper Tape is easy to tear with a natural porosity which allows skin to breathe. Ideal for situations involving frequent re-taping. </p>',NULL,'tegaderm-matrix-gauze-sponges-and-1-paper-tape',NULL,NULL,NULL,'Tegaderm Matrix, Gauze Sponges, Paper Tape',NULL,NULL),
