('165','1','1','<p><strong>Calcium Alginate Dressings 30 Pcs</strong><br />Calcium Alginate Dressings absorb<strong> moderate to heavy amounts of wound exudate</strong> and create and maintain a warm and moist wound environment. Made from needled High M fibers. Skinsafe Calcium Alginate Dressings are fast gelling,soft and comfortable. They have high wet and dry tensile strength and are easy to remove. </p>\r\n<p><strong>ABD Pads - 30 pieces     </strong><span style=\"font-size: 12px; line-height: 1.5em;\">Dupad abdominal pads are filled with cellulose fibers making them super-absorbent. The fibers quickly absorb and disperse fluids laterally to prevent pooling and maceration. The backing is constructed of a hydrophobic material which prevents strike-through. All edges are sealed to prevent linting. Latex Free.</span></p>\r\n<p><strong> <span style=\"font-size: 12px; line-height: 1.5em;\">2 Rolls paper tape 2\" -  </span></strong><span style=\"font-size: 12px; line-height: 1.5em;\">ReliaMed Paper Tape is easy to tear with a natural porosity which allows skin to breathe. Ideal for situations involving frequent re-taping.</span></p>','<p>Care Package for patients needing dressings for absorption.</p>','calcium-alginate-4x475-abd-pad-and-2-paper-tape',NULL,NULL,NULL,'Calcium Alginate, ABD Pad, and Paper Tape',NULL,NULL),
