('167','1','1','<p>A sting-free, alcohol-free liquid barrier film that dries quickly to form a breathable, transparent coating on the skin. Designed to protect intact or damaged skin from urine, feces, other body fluids, tape</p>','<p><span>A sting-free, alcohol-free liquid barrier film that dries quickly to form a breathable, transparent coating on the skin. Designed to protect intact or damaged skin from urine, feces, other body fluids, tape</span></p>','3m-no-sting-barrier-film-spray',NULL,NULL,NULL,'3M No Sting Barrier Film Spray',NULL,NULL),
