('168','1','1','<p><span style=\"font-size: 12px; line-height: 1.5em;\">Aside from its unique dual mode of action (hydrating dry to lightly exuding wounds while also capable of absorbing moderate amounts of exudates), this hybrid hydrogel/hydrocolloid dressing has several features giving it a distinct advantage over other dressings:</span></p>\r\n<ul>\r\n<li>Cooling and soothing upon application</li>\r\n<li>Extremely conformable, even in difficult to dress areas</li>\r\n<li>100% atraumatic adhesion across the wound contact surface</li>\r\n<li>Completely clear for easier wound observation</li>\r\n<li>Gelatin-free – so no associated odor common with standard hydrocolloids</li>\r\n</ul>','<p>A cool and soothing hybrid hydrogel/hydrocolloid dressing.  100% atraumatic adhesion and completely clear for wound observation. </p>','xtrasorb-hcs',NULL,NULL,NULL,'XTRASORB HCS  ',NULL,NULL),
('168','1','2',NULL,NULL,'xtrasorb-hcs',NULL,NULL,NULL,'Xtrasorb HCS',NULL,NULL),
