('168','1','6',NULL,NULL,'xtrasorb-hcs',NULL,NULL,NULL,'Xtrasorb HCS',NULL,NULL),
('169','1','1','<p><span><span>XTRASORB</span></span><span>  </span><span>Is a novel super-absorbent wound dressing. At its core is a super -absorbent polymer that allows the dressing to help re-define the category of highly absorbent dressings. Whereas other absorbent dressings (include foams, abd pads, and other cellulose-based dressings) rely on spaces within the dressings to fill with fluid, XTRASORB\'s super-absorbent polymer binds to fluid and converts to a gel. The distinct advantages this offers over traditional dressings are:<br /></span></p>\r\n<p><span style=\"font-size: 12px; line-height: 1.5em;\">XTRASORB</span><span style=\"font-size: 12px; line-height: 1.5em;\"> dressings are able to hold more fluid</span></p>\r\n<ul>\r\n<li><span><span>XTRASORB</span></span><span> dressings lock fluid inside the dressing, helping to <br /></span><span>decrease the risk of maceration</span><span><br /></span></li>\r\n<li><span><span>XTRASORB </span></span><span>dressings lock fluid inside the dressing, helping to keep <br /></span><span>the harmful contents inside would fluid away from the wound and <br /></span><span>periwound skin</span><span><br /></span></li>\r\n</ul>\r\n<p><span>The dressings come in a variety of sizes, and can be used on an assortment of chronic and acute wounds including:<br /></span></p>\r\n<p><span style=\"font-size: 12px; line-height: 1.5em;\">Pressure Ulcers</span></p>\r\n<p><span style=\"font-size: 12px; line-height: 1.5em;\">Diabetic Foot Ulcers</span></p>\r\n<ul>\r\n<li><span>Fistulas</span><span><br /></span></li>\r\n<li><span>Venous Leg Ulcers</span><span><br /></span></li>\r\n<li><span>Post-Operative Wounds</span><span><br /></span></li>\r\n<li><span>Oncologic Wounds</span><span><br /></span></li>\r\n<li><span>Arterial Ulcers</span><span><br /></span></li>\r\n<li><span>Laparotomy Wounds</span><span>  </span></li>\r\n</ul>','<p>A novel super-absorbent wound dressing that binds with fluid and converts to a gel. This product can be used on many types of chronic and acute wounds.</p>','xtrasorb-foam-non-adhesive',NULL,NULL,NULL,'XTRASORB Foam ',NULL,NULL),
