('170','1','1','<p>This conforming (stretch) gauze prevents bacteria from entering a wound and inhibits bacterial growth without toxicity to healthy tissue.  The cationic biocide Poly DADMAC is intrinsically bound to the substrate dressings to prevent bacteria from entering a wound and inhibit bacterial growth without toxicity to healthy tissue.</p>','<p>This conforming (stretch) gauze prevents bacteria from entering a wound and inhibits bacterial growth without toxicity to healthy tissue.</p>','biogard-conforming-gauze-barrier-dressing',NULL,NULL,NULL,'BIOGARD Conforming Gauze Barrier Dressing',NULL,NULL),
