('171','1','1','<p>MEDIHONEY®  Paste</p>\r\n<p>100% Active Leptospermum Honey</p>\r\n<p>• Helps to maintain a moist environment for optimal healing. <br />• High osmotic potential can promote an increase in the outflow of wound fluid aiding in autolytic debridement.<br />• Low pH helps to lower the pH within the wound environment, which has been shown to have wound healing benefits <br /> <br />• Easy-to-use, non-toxic, natural and safe with the potential for extended wear times</p>\r\n<p> </p>','<p>MEDIHONEY PASTE® - 100% Leptospermum Honey</p>','medihoney-paste','100% Leptospermum Honey','leptospermum honey,wounds,osmolarity,healing','MEDIHONEY Paste','MEDIHONEY® Paste',NULL,NULL),
