('180','1','1','<p>ColActive Plus Ag contains collagen, ionic silver, alginate and CMC.  This product targets excess protease activity to trigger the healing of chronic wounds. While this patented matrix atracts, binds and deactivates MMP\'s, it provides  prolonged, targeted MMP control without altering the activity of essential growth factors. Excess exudate is removed through the action of alginate and CMC while an optimal moisture balance is maintained for wound closure.  Ionic silver provides broad spectrum antimicrobial action.</p>\r\n<p>This easy to use product gels on contact with moisture and is highly conformable. It is ideal for restarting the healing process in chronic, difficult to heal wounds including diabetic foot ulcers, venous leg ulcers, pressure ulcers, donor and graft sites, traumatic wounds, dehisced surgical wounds, and1st and 2nd degree burns.</p>','<p>ColActive Plus Ag collagen with silver targets excess protease activity to trigger the healing of chronic wounds. </p>','colactive-plus-ag',NULL,NULL,NULL,'ColActive Plus Ag',NULL,NULL),
